INSERT INTO `article` VALUES (6,2,'',1,1,255,'如何注册成为会员','<span style=\"color:#337FE5;font-size:18px;\"><strong> </strong>\r\n<p>\r\n	<strong><span style=\"color:#337FE5;font-size:24px;\">一.手机端注册步骤</span> </strong>\r\n</p>\r\n<p class=\"p\">\r\n	<span style=\"color:#000000;font-family:Calibri;font-size:12pt;\"><span style=\"font-size:18px;\">1.</span><span><span style=\"font-size:18px;\">通过搜索</span></span></span><span style=\"color:#337FE5;font-family:Calibri;font-size:12pt;\"><span style=\"font-size:18px;\">http</span><span><span style=\"font-size:18px;\">：</span></span><span><span style=\"font-size:18px;\">//ypk99.com</span></span></span><span style=\"color:#000000;font-family:Calibri;font-size:18px;\"><span>网址或他人分享等途径进入逸陪康平台网站。</span></span><span style=\"color:#337FE5;font-family:Calibri;font-size:18px;\">&nbsp;</span><span style=\"font-family:Calibri;font-size:12pt;\"><?xml:namespace prefix = o ns = \"urn:schemas-microsoft-com:office:office\" /></span>\r\n</p>\r\n<p class=\"p\">\r\n	<span style=\"color:#000000;font-family:Calibri;font-size:12pt;\"><span style=\"font-size:18px;\">2.</span><span><span style=\"font-size:18px;\">点击首页的</span></span></span><span style=\"background:#E53333;color:#000000;font-family:Calibri;font-size:18px;\"><span>注册</span></span><span style=\"color:#000000;font-family:Calibri;font-size:18px;\"><span>按钮。</span></span><span style=\"color:#337FE5;font-family:Calibri;font-size:18px;\">&nbsp;</span><span style=\"font-family:Calibri;font-size:12pt;\"></span>\r\n</p>\r\n<p>\r\n	<!--EndFragment-->\r\n</p>\r\n<p>\r\n	<strong><span style=\"font-size:16px;\"><span style=\"font-size:16px;\"><img style=\"width:370px;height:468px;\" alt=\"\" src=\"/files/upload/shop/editor/image/1_admin/20170301090538_91499.png\" width=\"425\" height=\"498\" /></span></span> </strong>\r\n</p>\r\n<p>\r\n	<span style=\"font-size:16px;\"><span style=\"font-size:16px;\"></span></span><strong> </strong>\r\n</p>\r\n<p>\r\n	<span style=\"color:#000000;font-size:16px;background-color:#FFFFFF;\"><span style=\"color:#000000;font-size:16px;background-color:#FFFFFF;\">3.跳转到手机注册页面，输入手机号、短信验证码后，点下一步。</span></span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:16px;\"><span style=\"font-size:16px;\"></span></span><strong><img style=\"width:385px;height:283px;\" alt=\"\" src=\"/files/upload/shop/editor/image/1_admin/20170302085726_56634.png\" width=\"412\" height=\"342\" /> <span style=\"background-color:#FFFFFF;\"><span style=\"background-color:#FFFFFF;\"></span></span> </strong>\r\n</p>\r\n<p>\r\n	<strong><br />\r\n</strong>\r\n</p>\r\n<p>\r\n	<strong></strong>&nbsp;\r\n</p>\r\n</span> \r\n<p>\r\n	<strong><span style=\"color:#337FE5;font-size:24px;\">二.电脑端注册步骤</span></strong> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:18px;\">1.通过搜索</span><span style=\"color:#337FE5;font-size:18px;\">http：//ypk99.com</span><span style=\"font-size:18px;\">网址或他人分享等途径进入逸陪康平台网站。</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:16px;\"><span style=\"font-size:18px;\">2.点击右上角</span><span style=\"color:#000000;font-size:18px;background-color:#E53333;\">注册新会员</span><span style=\"font-size:18px;\">按钮。</span></span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:16px;\"><img style=\"width:336px;height:191px;\" alt=\"\" src=\"/files/upload/shop/editor/image/1_admin/20170301091833_26754.png\" width=\"394\" height=\"207\" /></span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:16px;\">3.跳到手机注册界面，输入手机号、验证码以及短信验证码后，点击下一步。</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:16px;\"><strong></strong></span><img style=\"width:536px;height:293px;\" alt=\"\" src=\"/files/upload/shop/editor/image/1_admin/20170302085450_84317.png\" width=\"582\" height=\"380\" /> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:16px;\"><strong></strong></span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:16px;\"><strong></strong></span> \r\n</p>\r\n<p>\r\n	<br />\r\n</p>',1449242303,NULL),(8,2,'',1,1,255,'忘记密码','<p>\r\n	<span style=\"font-size:18px;\"><strong>1.点击忘记密码按钮，跳转到手机找回密码界面。</strong></span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:18px;\"><img style=\"width:401px;height:327px;\" alt=\"\" src=\"/files/upload/shop/editor/image/1_admin/20170302090850_83872.png\" width=\"413\" height=\"348\" /></span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:18px;\"><strong>2.输入手机号码、验证码、短信验证码以及新密码后，再点击确认重置按钮。</strong></span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:18px;\"><img style=\"width:434px;height:377px;\" alt=\"\" src=\"/files/upload/shop/editor/image/1_admin/20170302091428_38682.png\" width=\"466\" height=\"479\" /></span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:18px;\"><strong>3.跳转到如下界面，即表示密码修改成功。</strong></span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:18px;\"><strong><img style=\"width:397px;height:157px;\" alt=\"\" src=\"/files/upload/shop/editor/image/1_admin/20170302091923_83586.png\" width=\"435\" height=\"157\" /></strong></span> \r\n</p>',1449242303,NULL),(9,2,'',1,1,255,'如何购买服务和咨询卡','<p>\r\n	<span style=\"color:#337FE5;font-size:24px;\"><strong>一.手机端购买流程</strong></span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:18px;\">1</span><span style=\"font-size:18px;\">.通过搜索拦搜索商品或医生、分类列表里查询等方法，找到需要购买的服务或咨询卡。</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:18px;\">2.点击<span style=\"background-color:#E53333;\">立即购买</span>按钮，确认接收方式无误后，点击<span style=\"background-color:#E53333;\">提交订单</span>按钮。</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:18px;\">3.选择支付方式，预存款支付或是支付宝支付。</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:18px;\">4.点击<span style=\"background-color:#E53333;\">确认支付</span>按钮即可。</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:18px;\">5.付款成功后手机会以短信的形式收到服务的<span style=\"background-color:#E53333;\">虚拟兑换码</span>以及服务的具体<span style=\"background-color:#E53333;\">时间和地点</span>。（注：咨询卡服务没有服务的具体时间和地点短信。）</span> \r\n</p>\r\n<p>\r\n	<br />\r\n<span style=\"color:#337FE5;font-size:24px;\"><strong>二.电脑端购买流程</strong></span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:18px;\">1</span><span style=\"font-size:18px;\">.通过搜索拦搜索商品或医生、分类列表里查询等方法，找到需要购买的服务或咨询卡。</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:18px;\">2.点击<span style=\"background-color:#E53333;\">立即购买</span>按钮，确认接收方式无误后，点击<span style=\"background-color:#E53333;\">提交订单</span>按钮。</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:18px;\">3.选择支付方式，可选账户余额支付、支付宝、财付通或是微信支付等方式。</span><br />\r\n<span style=\"font-size:18px;\">4.点击<span style=\"background-color:#E53333;\">确认支付</span>按钮即可。</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:18px;\">5.付款成功后手机会以短信的形式收到服务的<span style=\"background-color:#E53333;\">虚拟兑换码</span>以及服务的具体<span style=\"background-color:#E53333;\">时间和地点</span>。（注：咨询卡服务没有服务的具体时间和地点短信。）</span> \r\n</p>',1449242303,NULL),(11,3,'',1,1,255,'如何管理店铺','如何管理店铺',1449242303,NULL),(12,3,'',1,1,255,'查看售出商品','查看售出商品',1449242303,NULL),(14,3,'',1,1,255,'商城商品推荐','商城商品推荐',1449242303,NULL),(15,3,'',1,1,255,'如何申请开店','如何申请开店',1449242303,NULL),(16,4,'',1,1,255,'如何注册支付宝','如何注册支付宝',1449242303,NULL),(17,4,'',1,1,255,'在线支付','在线支付',1449242303,NULL),(19,6,'',1,1,255,'会员修改个人资料','<p class=\"p\">\r\n	<span style=\"color:#0070C0;font-family:宋体;font-size:18pt;\"><span>一．手机端修改流程</span></span><span style=\"color:#0070C0;font-family:宋体;font-size:18pt;\"></span> \r\n</p>\r\n<p class=\"p\">\r\n	<span style=\"font-family:宋体;font-size:13.5pt;\">1.<span>点击</span></span><span style=\"background:#E53333;font-family:宋体;font-size:13.5pt;\"><span>我的</span></span><span style=\"font-family:宋体;font-size:13.5pt;\"><span>按钮，进入页面，在</span></span><span style=\"background:#E53333;font-family:宋体;font-size:13.5pt;\"><span>完善资料</span></span><span style=\"font-family:宋体;font-size:13.5pt;\"><span>里填写需要修改的资料，点击提交保存</span></span><span style=\"font-family:宋体;font-size:13.5pt;\"><span>按钮即修改成功。</span></span><span style=\"font-family:宋体;font-size:13.5pt;\"></span> \r\n</p>\r\n<p class=\"p\">\r\n	<span style=\"font-family:宋体;font-size:13.5pt;\">2.<span>在我的页面里，点击</span></span><span style=\"background:#E53333;font-family:宋体;font-size:13.5pt;\"><span>收</span></span><span style=\"background:#E53333;font-family:宋体;font-size:13.5pt;\"><span>货地址管理</span></span><span style=\"font-family:宋体;font-size:13.5pt;\"><span>，点击编辑或添加新地址，填写好后点击保存地址按钮。</span></span><span style=\"font-family:宋体;font-size:13.5pt;\"></span> \r\n</p>\r\n<!--EndFragment-->\r\n<p>\r\n	<br />\r\n</p>\r\n<p class=\"p\">\r\n	<span style=\"color:#0070C0;font-family:宋体;font-size:18pt;\"><span>二．电脑端修改流程</span></span><span style=\"color:#0070C0;font-family:宋体;font-size:18pt;\"></span> \r\n</p>\r\n<p class=\"p\">\r\n	<span style=\"font-family:宋体;font-size:13.5pt;\"><span>点击右上角<span style=\"background-color:#E53333;\">我的</span>菜单下的</span></span><span style=\"background:#E53333;font-family:宋体;font-size:13.5pt;\"><span>我的用户中心</span></span><span style=\"font-family:宋体;font-size:13.5pt;\"><span>按钮，在左边</span></span><span style=\"background:#E53333;font-family:宋体;font-size:13.5pt;\"><span>用户设置</span></span><span style=\"font-family:宋体;font-size:13.5pt;\"><span>列表下可以修改个人资料、收货地址、会员头像和密码等。</span></span> \r\n</p>\r\n<p>\r\n	<!--EndFragment-->\r\n</p>',1449242303,NULL),(20,2,'',1,1,255,'如何发布服务','<p>\r\n	<span style=\"color:#337FE5;font-size:24px;\">一.手机端发布服务流程</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:18px;\">1.点击<span style=\"background-color:#E53333;\">我的</span>按钮，进入我的页面，点击<span style=\"background-color:#E53333;\">发布服务</span>按钮，进入我的服务页面。</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:18px;\">2.将所有<span style=\"background-color:#E53333;\">打</span><span style=\"background-color:#E53333;\">*</span>的内容根据实际情况全部填写好。</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:18px;\">3.填写完成后，点击<span style=\"background-color:#E53333;\">提交保存</span>按钮，保存成功后页面显示等待后台审核的消息。</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:18px;\">4.如果审核通过，在我的服务页面可看到已经发布成功的服务；如果审核未通过，后台管理人员会跟您联系。</span> \r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<span style=\"font-size:18px;\"></span><span style=\"color:#337FE5;font-size:24px;\">二.电脑端发布服务流程</span> \r\n</p>\r\n<p class=\"p\">\r\n	<span style=\"font-family:宋体;font-size:13.5pt;\">1.<span>进入医护人员的商家中心，点服务菜单下的</span></span><span style=\"background:#E53333;font-family:宋体;font-size:13.5pt;\"><span>发布服务</span></span><span style=\"font-family:宋体;font-size:13.5pt;\"><span>按钮。</span></span><span style=\"font-family:宋体;font-size:13.5pt;\"></span> \r\n</p>\r\n<p class=\"p\">\r\n	<span style=\"font-family:Calibri;font-size:13.5pt;\">2.<span>将所有</span></span><span style=\"background:#E53333;font-family:Calibri;font-size:13.5pt;\"><span>打</span>*</span><span style=\"background:#E53333;font-family:宋体;font-size:13.5pt;\"><span>号</span></span><span style=\"font-family:Calibri;font-size:13.5pt;\"><span>的</span></span><span style=\"font-family:宋体;font-size:13.5pt;\"><span>服务基本信息</span></span><span style=\"font-family:Calibri;font-size:13.5pt;\"><span>内容根据实际情况全部填写好</span></span><span style=\"font-family:宋体;font-size:13.5pt;\"><span>，没打</span></span><span style=\"font-family:宋体;font-size:13.5pt;\">*<span>的可选填。</span></span><span style=\"font-family:宋体;font-size:13.5pt;\"></span> \r\n</p>\r\n<p class=\"p\">\r\n	<span style=\"font-family:宋体;font-size:13.5pt;\">3.</span><span style=\"font-family:Calibri;font-size:13.5pt;\"><span>填写完成后，点击</span></span><span style=\"background:#E53333;font-family:Calibri;font-size:13.5pt;\"><span>提交</span></span><span style=\"background:#E53333;font-family:宋体;font-size:13.5pt;\"><span>发布</span></span><span style=\"font-family:Calibri;font-size:13.5pt;\"><span>按钮，保存成功后页面显示等待后台审核的消息。</span></span><span style=\"font-family:Calibri;font-size:12pt;\"> </span><span style=\"font-family:Calibri;font-size:12pt;\"></span> \r\n</p>\r\n<p class=\"p\">\r\n	<span style=\"font-family:Calibri;font-size:13.5pt;\">4.<span>如果审核通过，在我的服务页面可看到已经发布成功的服务；如果审核未通过，后台管理人员会跟您联系。</span></span><span style=\"font-family:Calibri;font-size:12pt;\"> </span><span style=\"font-family:Calibri;font-size:12pt;\"></span> \r\n</p>\r\n<p>\r\n	<!--EndFragment-->\r\n</p>\r\n<p>\r\n	<br />\r\n</p>',1449242303,NULL),(22,7,'',1,1,255,'关于我们','<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 星速科技是由一批青年为网店经营者提供技术支持及