ng>： 138182377 <br />\r\n<strong>商务洽谈</strong>： 138182377 <br />\r\n</p>',1449242303,NULL),(26,5,'',1,1,255,'联系卖家','联系卖家',1449242303,NULL),(28,4,'',1,1,255,'分期付款','分期付款<br />',1449242303,NULL),(29,4,'',1,1,255,'邮局汇款','邮局汇款<br />',1449242303,NULL),(30,4,'',1,1,255,'公司转账','公司转账<br />',1449242303,NULL),(32,5,'',1,1,255,'退换货流程','退换货流程',1449242303,NULL),(34,5,'',1,1,255,'退款申请','<p class=\"p\">\r\n	<span style=\"font-family:宋体;font-size:18px;\"><span style=\"font-size:18px;\">1.</span></span><span style=\"font-family:宋体;font-size:18px;\"><span style=\"font-size:18px;\">进入<span style=\"color:#337FE5;\">我的订单</span>页面，找到需要退款的订单，点击</span></span><span style=\"background:#E53333;font-family:宋体;font-size:18px;\"><span style=\"font-size:18px;\">退款</span></span><span style=\"font-family:宋体;font-size:18px;\"><span style=\"font-size:18px;\">按钮。在弹出框里输入退款理由，点击</span></span><span style=\"background:#E53333;font-family:宋体;font-size:18px;\"><span style=\"font-size:18px;\">确认提交</span></span><span style=\"font-family:宋体;font-size:18px;\"><span style=\"font-size:18px;\">按钮。经后台管理员审核后，当退款审核状态为同意时，即表示退款成功。</span></span><span style=\"font-family:宋体;font-size:13.5pt;\"></span> \r\n</p>\r\n<p class=\"p\">\r\n	<br />\r\n</p>\r\n<span style=\"font-family:宋体;font-size:14pt;\"><span></span></span><span style=\"font-family:宋体;font-size:14pt;\"></span> \r\n<p class=\"p\">\r\n	<span style=\"color:#0070C0;font-family:宋体;font-size:14pt;\"><span><strong>提示：发起退款的时间距离服务开始的时间小于</strong></span><strong>12</strong><span><strong>小时，就无法退款。</strong></span></span><span style=\"color:#0070C0;font-family:宋体;font-size:14pt;\"></span> \r\n</p>\r\n<p class=\"p\">\r\n	<!--EndFragment-->\r\n</p>\r\n<!--EndFragment--><!--EndFragment-->',1449242303,NULL),(35,10,'',1,1,1,'颈椎病','<h2 style=\"text-align:center;color:#3E3E3E;text-indent:0px;background-color:#FFFFFF;\">\r\n	<span style=\"color:#AB1942;font-size:18px;\"><strong><br class=\"Apple-interchange-newline\" />\r\n脖子疼就一定是颈椎病吗？</strong></span> \r\n</h2>\r\n<p style=\"color:#3E3E3E;text-indent:0px;background-color:#FFFFFF;\">\r\n	<span style=\"color:#AB1942;font-size:18px;\"><strong><br />\r\n</strong></span> \r\n</p>\r\n<h2 style=\"font-size:16px;font-weight:400;\">\r\n	<span><strong><span>先来说说颈椎病，医学上是这么定义的：颈椎病，是指颈椎椎间盘组织退行性改变及其继发椎间关节退行性(即老化)改变累及其周围重要组织结构(神经根、脊髓、椎动脉、交感神经等)，出现相应的临床表现。</span></strong></span> \r\n</h2>\r\n<p style=\"text-align:center;color:#3E3E3E;text-indent:0px;background-color:#FFFFFF;\">\r\n	<br />\r\n</p>\r\n<p style=\"text-align:center;color:#3E3E3E;text-indent:0px;background-color:#FFFFFF;\">\r\n	<img style=\"width:360px !important;height:auto !important;\" src=\"http://mmbiz.qpic.cn/mmbiz_jpg/fGJBic2IGMJIhg7iaRwibztK5Afxf22XjZCaEZYRqpwmd1O5m7ichVBsvZiaFEIic3pXrudC76xLHZaMPmj0N4WvtLoQ/640?tp=webp&wxfrom=5&wx_lazy=1\" width=\"360\" height=\"202\" /> \r\n</p>\r\n<p style=\"color:#3E3E3E;text-indent:0px;background-color:#FFFFFF;\">\r\n	<span></span> \r\n</p>\r\n<p style=\"color:inherit;\">\r\n	<span><strong><span>简单说来，医生要诊断是颈椎病，以下三个条件缺一不可：</span></strong></span> \r\n</p>\r\n<p style=\"color:inherit;\">\r\n	<span>颈椎间盘组织及关节发生改变；</span> \r\n</p>\r\n<p>\r\n	<span><br />\r\n</span> \r\n</p>\r\n<p>\r\n	<span>这种改变影响了周围的组织；</span> \r\n</p>\r\n<p>\r\n	<span><br />\r\n</span> \r\n</p>\r\n<p>\r\n	<span>并出现了临床症状如脖子疼等。</span> \r\n</p>\r\n<p style=\"color:#3E3E3E;text-indent:0px;background-color:#FFFFFF;\">\r\n	<span><strong><span><br />\r\n</span></strong></span> \r\n</p>\r\n<p style=\"color:#3E3E3E;text-indent:0px;background-color:#FFFFFF;\">\r\n	<span><strong><span>所以，单凭脖子疼是不能武断地认为是颈椎病的。</span></strong></span> \r\n</p>\r\n<p style=\"text-align:center;color:#3E3E3E;text-indent:0px;background-color:#FFFFFF;\">\r\n	<span><img style=\"width:400px !important;height:212px !important;\" src=\"data:image/png;base64,\" /><br />\r\n</span> \r\n</p>\r\n<p style=\"color:#3E3E3E;text-indent:0px;background-color:#FFFFFF;\">\r\n	<span><br />\r\n</span> \r\n</p>\r\n<p style=\"text-align:center;color:#3E3E3E;text-indent:0px;background-color:#FFFFFF;\">\r\n	<span style=\"color:#AB1942;font-size:18px;\"><strong>如何自我鉴别真伪颈椎病呢？</strong></span> \r\n</p>\r\n<p style=\"color:#3E3E3E;text-indent:0px;background-color:#FFFFFF;\">\r\n	<span></span> \r\n</p>\r\n<span><strong>真颈椎病</strong></span><span></span> \r\n<p style=\"color:#50B0E1;\">\r\n	<span>\r\n	<hr />\r\n	<hr />\r\n	<img border=\"0\" alt=\"\" src=\"http://ypk99.com/resource/kindeditor/plugins/emoticons/images/10.gif\" /><img border=\"0\" alt=\"\" src=\"http://ypk99.com/resource/kindeditor/plugins/emoticons/images/11.gif\" /><br />\r\n</span> \r\n</p>\r\n<p style=\"color:#50B0E1;\">\r\n	<span style=\"color:#000000;\">脖子痛的同时还出现了以下情况之一，应该考虑颈椎病的可能。</span><span><br />\r\n</span> \r\n</p>\r\n<p style=\"color:#50B0E1;\">\r\n	<span><br />\r\n</span> \r\n</p>\r\n<p style=\"color:#50B0E1;\">\r\n	<span><span>⊙</span><strong><span>手臂麻痹加剧</span></strong></span> \r\n</p>\r\n<p>\r\n	<span><br />\r\n</span> \r\n</p>\r\n<p>\r\n	<span>将一侧手臂水平伸直与肩同高，头颈往另一侧使劲儿抻拉。如果手臂延伸至指尖的麻痹症状加剧，那么颈椎病的可能较大。</span> \r\n</p>\r\n<p style=\"color:#50B0E1;\">\r\n	<span><br />\r\n</span> \r\n</p>\r\n<p style=\"color:#50B0E1;\">\r\n	<span><span>⊙</span><strong><span>疼痛持续存在</span></strong></span> \r\n</p>\r\n<p>\r\n	<span><br />\r\n</span> \r\n</p>\r\n<p>\r\n	<span>脖子疼不会因为天气、锻炼、休息等因素的改变而改变，而是持续存在着，那这种疼痛很可能是颈椎病造成的。</span> \r\n</p>\r\n<p style=\"color:#50B0E1;\">\r\n	<span><br />\r\n</span> \r\n</p>\r\n<p style=\"color:#50B0E1;\">\r\n	<span><span>⊙</span><strong><span>四肢出现不便</span></strong></span> \r\n</p>\r\n<p style=\"color:#50B0E1;\">\r\n	<br />\r\n</p>\r\n<p style=\"color:#50B0E1;\">\r\n	<span style=\"color:#3E3E3E;line-height:28px;font-size:16px;background-color:#FFFFFF;\">脚下无力有“踩棉花”的感觉，双手的灵活性下降，扣扣子、夹菜等比较困难。</span> \r\n</p>\r\n<p style=\"color:#3E3E3E;text-indent:0px;background-color:#FFFFFF;\">\r\n	<br />\r\n</p>\r\n<p style=\"text-align:center;color:#3E3E3E;text-indent:0px;background-color:#FFFFFF;\">\r\n	<img alt=\"\" src=\"/files/upload/shop/editor/image/1_admin/20170109163519_48356.jpg\" /> \r\n</p>\r\n<span><strong>伪颈椎病</strong></span><span></span> \r\n<p style=\"color:#50B0E1;\">\r\n	<span><br />\r\n</span> \r\n</p>\r\n<p style=\"color:#50B0E1;\">\r\n	<span style=\"color:#000000;\">出现以下状况，则表明并不是颈椎病引起的脖子疼痛。</span><span><br />\r\n</span> \r\n</p>\r\n<p style=\"color:#50B0E1;\">\r\n	<span><br />\r\n</span> \r\n</p>\r\n<p style=\"color:#50B0E1;\">\r\n	<span><span>⊙</span><strong><span>休息就能解决疼痛</span></strong></span> \r\n</p>\r\n<p style=\"color:#50B0E1;\">\r\n	<span><strong><span><br />\r\n</span></strong></span> \r\n</p>\r\n<p>\r\n	<span>长时间对着电脑工作后出现了脖子疼，其他症状都没有。离开电脑，休息一段时间，疼痛缓解了，那只是颈部肌肉劳损。</span> \r\n</p>\r\n<p style=\"color:#50B0E1;\">\r\n	<span><br />\r\n</span> \r\n</p>\r\n<p style=\"color:#50B0E1;\">\r\n	<span><span>⊙</span><strong><span>转完脖子就没事儿</span></strong></span> \r\n</p>\r\n<p style=\"color:#50B0E1;\">\r\n	<br />\r\n</p>\r\n<p style=\"color:#50B0E1;\">\r\n	<span style=\"color:#3E3E3E;line-height:28px;font-size:16px;background-color:#FFFFFF;\">脖子又酸又疼，轻轻地转一圈，咦，不疼了。其实，这是累的，跟颈椎无关。</span> \r\n</p>\r\n<p style=\"color:#50B0E1;\">\r\n	<span><br />\r\n</span> \r\n</p>\r\n<p style=\"color:#50B0E1;\">\r\n	<span><span>⊙</span><strong><span>头晕头痛</span></strong></span> \r\n</p>\r\n<p style=\"color:#50B0E1;\">\r\n	<br />\r\n</p>\r\n<p style=\"color:#50B0E1;\">\r\n	<span style=\"color:#3E3E3E;line-height:28px;font-size:16px;background-color:#FFFFFF;\">虽然，颈椎病会引起头晕和头痛。但是神经内科疾病，也会出现头晕头痛的症状，因此不能单凭这一症状，就判断是颈椎病。</span> \r\n</p>\r\n<p style=\"color:#3E3E3E;text-indent:0px;background-color:#FFFFFF;\">\r\n	<br />\r\n</p>\r\n<p style=\"color:#3E3E3E;text-indent:0px;background-color:#FFFFFF;\">\r\n	特别注意的是，若怀疑自己是颈椎病，别盲目到按摩室治疗，不正确的手法反而易使颈关节错位。一定要到正规医院的骨科或者脊柱外科请专业医生诊断并给出治疗方案。<span><br />\r\n</span> \r\n</p>\r\n<p style=\"color:#3E3E3E;text-indent:0px;background-color:#FFFFFF;\">\r\n	<span><br />\r\n</span> \r\n</p>\r\n<p style=\"text-align:center;color:#3E3E3E;text-indent:0px;background-color:#FFFFFF;\">\r\n	<span></span> \r\n</p>\r\n<p style=\"color:#3E3E3E;text-indent:0px;background-color:#FFFFFF;\">\r\n	<span><br />\r\n</span> \r\n</p>\r\n<p style=\"text-align:center;color:#3E3E3E;text-indent:0px;background-color:#FFFFFF;\">\r\n	<span style=\"color:#AB1942;font-size:18px;\"><strong></strong></span> \r\n</p>',1449242303,NULL),(36,1,'',1,1,255,'管理功能说明','管理功能说明',1449242303,NULL),(37,1,'',1,1,255,'如何扩充水印字体库','如何扩充水印字体库',1449242303,NULL),(38,1,'',1,1,255,'提示信息','提示信息',1449242303,NULL),(39,2,'',1,1,255,'积分细则','积分细则积分细则',1449242303,NULL),(40,2,'',1,1,255,'积分兑换说明','积分兑换说明',1449242303,NULL),(41,1,'',1,1,255,'功能使用说明','功能使用说明',1449242303,NULL),(44,10,'',1,1,255,'第四批经营个人税收优惠型健康保险业务公司名单公示','<p class=\"otitle\" style=\"font-size:18px;text-indent:2em;font-family:&quot;color:#404040;text-align:justify;background-color:#CCE8CF;\">\r\n	（原标题：第四批经营个人税收优惠型健康保险业务公司名单公示）\r\n</p>\r\n<p style=\"font-size:18px;text-indent:2em;font-family:&quot;color:#404040;text-align:justify;background-color:#CCE8CF;\">\r\n	中新网12月20日电 据保监会网站消息，保监会今日公示第四批经营个人税收优惠型健康保险业务公司名单，含光大永明人寿保险有限公司、民生人寿保险股份有限公司等。保监会表示，进入名单的保险公司要严格按照相关规定，经营好个人税收优惠型健康保险业务。\r\n</p>\r\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" align=\"left\" style=\"font-size:12px;margin:0px auto;color:#404040;font-family:&quot;text-align:justify;background-color:#CCE8CF;\" class=\"ke-zeroborder\">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<p style=\"font-size:18px;text-indent:2em;font-family:&quot;color:#404040;text-align:justify;background-color:#CCE8CF;\">\r\n	为推进个人税收优惠型健康保险业务试点规范运行，保监会对已报送的开展个人税收优惠型健康保险业务报告进行了认真核对，共有七家保险公司符合《通知》中所列经营要求。按照“成熟一家，公布一家”的原则，现将经营个人税收优惠型健康保险业务公司名单(第四批)公示如下：光大永明人寿保险有限公司、民生人寿保险股份有限公司、农银人寿保险股份有限公司、昆仑健康保险股份有限公司、国华人寿保险股份有限公司、幸福人寿保险股份有限公司、德华安顾人寿保险有限公司。进入名单的保险公司要严格按照相关规定，经营好个人税收优惠型健康保险业务。\r\n</p>\r\n<p style=\"font-size:18px;text-indent:2em;font-family:&quot;color:#404040;text-align:justify;background-color:#CCE8CF;\">\r\n	保监会称，下一步将继续核对保险公司开展个人税收优惠型健康保险业务的报告，并及时更新经营个人税收优惠型健康保险业务的公司名单；将加强对个人税收优惠型健康保险产品及经营行为的监管，保护消费者的合法权益，推动业务规范、有序开展。\r\n</p>',1482227472,NULL),(45,10,'',1,1,255,'朋友圈传雾霾产生病菌为谣言 但雾霾会危害健康','<p class=\"otitle\" style=\"font-size:18px;text-indent:2em;font-family:&quot;color:#404040;text-align:justify;background-color:#CCE8CF;\">\r\n	（原标题：朋友圈传雾霾产生病菌为谣言 但雾霾会危害健康）\r\n</p>\r\n<p style=\"font-size:18px;text-indent:2em;font-family:&quot;color:#404040;text-align:justify;background-color:#CCE8CF;\">\r\n	大众网菏泽12月20日讯(记者孔祥申)连日来，菏泽遭遇“十面霾伏”，19日AQI(空气质量指数)达到严重污染。雾霾笼罩之下，一则“雾霾产生的病毒侵害儿童”的消息在微信朋友圈传开。很多家长为此担忧不已。大众网记者今日从菏泽市疾病预防控制中心获悉，网上流传雾霾含有病毒能引起传染病流行等均为谣言。目前没有证据证明雾霾自己能产生病毒。\r\n</p>\r\n<p style=\"font-size:18px;text-indent:2em;font-family:&quot;color:#404040;text-align:justify;background-color:#CCE8CF;\">\r\n	雾霾产生病菌在朋友圈传开 家长担心孩子受伤害\r\n</p>\r\n<p style=\"font-size:18px;text-indent:2em;font-family:&quot;color:#404040;text-align:justify;background-color:#CCE8CF;\">\r\n	大众网记者从网友发来的朋友圈截图看到，这则雾霾产生的病菌侵害儿童的消息大致内容是：此次雾霾产生的病菌侵害主体为12岁以下儿童，具有传染性。病体特征：咳嗽、扁桃体肿大、上午偶有发烧、下午或晚间发烧特征明显，最低温度在38 .3 ，最高温度在39.4 。治疗方法：住院。打针吃药能暂时维持却不治本。入院前五天下午和晚间还会维持38.3 以上高烧。经多次雾霾实践检验，中国雾霾已携带各种传染病菌，尽量减少孩子户外活动。家长们千万不要不当回事！转发！\r\n</p>\r\n<p style=\"font-size:18px;text-indent:2em;font-family:&quot;color:#404040;text-align:justify;background-color:#CCE8CF;\">\r\n	“这两天朋友圈好多妈妈都在转发这条微信，如果是真的就太可怕了。”家住菏泽市西城的刘女士告诉大众网记者，自己的宝宝刚刚半岁，看到这则消息后十分担心，但又不知道去哪里求证。像刘女士这样担心的不在少数，大众网记者了解到，很多年轻母亲都在转发这条朋友圈，有一位母亲说自己孩子这几天生病了，症状和朋友圈所传一样。\r\n</p>\r\n<p style=\"font-size:18px;text-indent:2em;font-family:&quot;color:#404040;text-align:justify;background-color:#CCE8CF;\">\r\n	菏泽市疾控中心辟谣 雾霾不会产生病菌\r\n</p>\r\n<p style=\"font-size:18px;text-indent:2em;font-family:&quot;color:#404040;text-align:justify;background-color:#CCE8CF;\">\r\n	针对此事，大众网记者采访了菏泽市疾病预防控制中心应急办主任孙秀华。孙秀华表示，目前没有证据证明雾霾能自己产生病菌，朋友圈所传为谣言。病菌广泛存在于自然界中，传染病的流行发生要有传染源、传播途径、易感人群，人们只要采取适当的防护措施(戴口罩等)就能阻断传播的途径，预防呼吸道传染病的发生。\r\n</p>\r\n<p style=\"font-size:18px;text-indent:2em;font-family:&quot;color:#404040;text-align:justify;background-color:#CCE8CF;\">\r\n	“冬季本就是呼吸道疾病高发期，具体表现为易犯哮喘、支气管炎等。特别是孩子容易犯季节性扁桃体炎。”孙秀华告诉大众网记者，朋友圈所传的症状类似于呼吸道疾病症状，冬季本属于高发期，雾霾只是一种大气污染现象，不能称之为传染源，市疾控中心也一直严密监测，没有发现传染性疾病异常增高趋势。\r\n</p>\r\n<p style=\"font-size:18px;text-indent:2em;font-family:&quot;color:#404040;text-align:justify;background-color:#CCE8CF;\">\r\n	雾霾可对人体造成血液中毒、肺水肿等多种危害\r\n</p>\r\n<p style=\"font-size:18px;text-indent:2em;font-family:&quot;color:#404040;text-align:justify;background-color:#CCE8CF;\">\r\n	那么雾霾的危害到底在哪？孙秀华表示，雾霾的危害主要在于一旦被人从呼吸道吸入，就会沉积于人的肺泡，沉积肺泡的烟尘被溶解后进入血液，容易造成血液中毒。未被溶解的部分被细胞吸收容易破坏细胞造成尘肺。霾中所含有的其他有害物质如二氧化硫主要是刺激人的呼吸道，对人的危害更大。\r\n</p>\r\n<p style=\"font-size:18px;text-indent:2em;font-family:&quot;color:#404040;text-align:justify;background-color:#CCE8CF;\">\r\n	雾霾严重时，其中的污染物杂质可使人的中枢神经发生病变，引起肺水肿或慢性气管炎，特别是当人们吸入肺部，严重时可导致肺气肿及肺癌等症。霾中的化学烟雾，当浓度达到某一界限后，就会对人的眼睛、呼吸道产生危害。霾中的一氧化碳，当其浓度为900PPm时，人接触1小时就会感到头痛、眼睛呆滞；当浓度达到1200PPm时，人接触1小时就会神经麻痹，有生命危险。霾中的碳氧化物，对人的眼、鼻和呼吸道有强烈的刺激作用，在一定条件下，将对肝、胃和心脏血管系统的功能产生破坏作用。\r\n</p>\r\n<p style=\"font-size:18px;text-indent:2em;font-family:&quot;color:#404040;text-align:justify;background-color:#CCE8CF;\">\r\n	雾霾天还会影响人的情绪，因为整天天气都处于阴霾沉沉，太阳昏黄阴暗，人体中的松果体会分泌出较多的松果体素，使得甲状腺素、肾上腺素的浓度相对降低。甲状腺素、肾上腺素等是唤起细胞工作的激素，一旦减少，细胞就会“偷懒”，变得极不活跃，人也就会显得无精打采。\r\n</p>\r\n<p style=\"font-size:18px;text-indent:2em;font-family:&quot;color:#404040;text-align:justify;background-color:#CCE8CF;\">\r\n	针对雾霾产生的危害，孙秀华也给出了几点防护措施。\r\n</p>\r\n<p style=\"font-size:18px;text-indent:2em;font-family:&quot;color:#404040;text-align:justify;background-color:#CCE8CF;\">\r\n	附有效防护措施：\r\n</p>\r\n<p style=\"font-size:18px;text-indent:2em;font-family:&quot;color:#404040;text-align:justify;background-color:#CCE8CF;\">\r\n	(1)减少出门是自我保护最有效的办法，尤其是有心脑血管、呼吸系统疾病的人群，更要尽量少出门。必须外出时记着戴口罩，不要开启车窗，减少对呼吸道的污染。\r\n</p>\r\n<p style=\"font-size:18px;text-indent:2em;font-family:&quot;color:#404040;text-align:justify;background-color:#CCE8CF;\">\r\n	(2)可以暂时减少晨练，尽量选择在10—14时外出。同时，要多喝水，少吸烟并远离“二手烟”，减轻肺、肝等器官的负担。\r\n</p>\r\n<p style=\"font-size:18px;text-indent:2em;font-family:&quot;color:#404040;text-align:justify;background-color:#CCE8CF;\">\r\n	(3)雾霾天必须外出，回到室内后要做到：洗脸最好用温水，可以将附着在皮肤上的阴霾颗粒有效清洁干净；漱口清除附着在口腔的脏东西；最关键的是清理鼻腔。\r\n</p>\r\n<p style=\"font-size:18px;text-indent:2em;font-family:&quot;color:#404040;text-align:justify;background-color:#CCE8CF;\">\r\n	(4)在大雾天气升级的情况下尽量不要开窗；确实需要开窗透气的话，开窗时应尽量避开早晚雾霾高峰时段，可以将窗户打开一条缝通风，不让风直接吹进来，通风时间每次以半小时至一小时为宜。\r\n</p>',1482227511,NULL),(52,12,'',1,1,255,'关节劳损','<p style=\"text-align:center;color:#000000;text-indent:0px;background-color:#FFFFFF;\">\r\n	<span style=\"color:#7B0C00;font-size:18px;\"><strong><span style=\"color:#7B0C00;\">解决关节不活泛的好办法</span></strong></span> \r\n</p>\r\n<p style=\"text-align:center;color:#000000;text-indent:0px;background-color:#FFFFFF;\">\r\n	<span style=\"color:#7B0C00;font-size:18px;\"><strong><span style=\"color:#7B0C00;\"> 常吃常舒畅，越吃越活泛！</span></strong></span> \r\n</p>\r\n<p style=\"color:#000000;text-indent:0px;background-color:#FFFFFF;\">\r\n	<br />\r\n</p>\r\n<p style=\"color:#000000;text-indent:0px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:16px;\"><span>这个东西是我们饮食中的一种调味品，因它的独特味道，人们对其毁誉参半，喜爱之人说它冲鼻的辛辣</span><span style=\"line-height:2em;\">令人回味无穷，不喜欢它的人会说找涕泪俱下这种感觉纯属自虐，它就是芥末。</span></span> \r\n</p>\r\n<p style=\"color:#000000;text-indent:0px;background-color:#FFFFFF;\">\r\n	<br />\r\n</p>\r\n<p style=\"color:#000000;text-indent:0px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:16px;\">但是由不得你喜欢不喜欢，今天要给大家说的是：<span style=\"color:#953734;font-size:16px;\"><strong>这个芥末酱，<span style=\"font-size:16px;\">在这2~4月换季的时候</span>，常食能够奇迹一般的缓解关节紧绷、陈年关节炎疼痛的感觉。</strong></span>让关节、骨头恢复到被松绑的、自如的原本状态。有很多朋友吃一次第二天就能感到关节“松活”了，特别是对于膝盖、肩膀、手指这种关节部位，可以夸张点说是立竿见影的效果。</span> \r\n</p>\r\n<p style=\"text-align:center;color:#000000;text-indent:0px;background-color:#FFFFFF;\">\r\n	<img style=\"width:auto !important;height:auto !important;\" src=\"https://mmbiz.qlogo.cn/mmbiz_jpg/IhImYwtyia80CXAsXeiaK1DvZLVOxw5KY3MIqUjmlVMoLD7UhibOhhWPUUAj5ToJNTvajOT5MFPwHUo98RqgGPCkg/640?wx_fmt=jpeg\" width=\"auto\" /> \r\n</p>\r\n<p style=\"color:#000000;text-indent:0px;\">\r\n	<br />\r\n</p>\r\n？<span style=\"line-height:30.4px;font-size:18px;vertical-align:top;\"><strong>芥末是化学制剂吗？</strong></span> \r\n<p style=\"color:#000000;text-indent:0px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:16px;\">不是。芥末原产于我国，历史悠久，从周代起就已开始在宫廷食用，<span style=\"color:#953734;\"><strong>绿绿的颜色不是化学染料染成的，而是十字花科植物白芥的成熟种子碾磨成的一种粉状天然调味品</strong></span>，它的外表绿油油的十分好看，但初尝者往往被它独特的味道辣的不敢再次尝试，因而错过了这种缓解关节痛的好东西。</span> \r\n</p>\r\n<p style=\"color:#000000;text-indent:0px;\">\r\n	<br />\r\n</p>\r\n<p style=\"text-align:left;\">\r\n	<span style=\"font-size:18px;\"><strong>主管关节痛，附带5大功效，</strong></span><strong>个个都是宝贝~</strong> \r\n</p>\r\n<span style=\"font-size:18px;\">1</span><span style=\"font-size:18px;\"><strong><span style=\"line-height:32px;vertical-align:top;\">散寒，止痛，帮助活泛老年关节炎~</span></strong></span> \r\n<p style=\"color:#000000;text-indent:0px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:16px;\">《本草纲目》说 ：白芥“利气豁痰，除寒暖中，散肿止痛。治喘嗽反胃，痹木脚气，筋骨腰节诸痛。”芥末性温味辛，归肺经、胃经，有温中散寒、散结消肿、明目利膈的功效，主治疮痈肿痛、耳目失聪、牙龈肿烂、寒腹痛、便秘等病症。</span> \r\n</p>\r\n<p style=\"color:#000000;text-indent:0px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:16px;\"><span>此外，促进血液循环也有不错的帮助作用。</span><span style=\"color:#953734;\"><strong><span>自古以</span><span style=\"line-height:2em;\">来，辛辣的芥末总是被人们当作一种药草使用，是缓解疼痛的一把好手。</span></strong><strong><span style=\"line-height:2em;\"></span></strong></span></span> \r\n</p>\r\n<p style=\"color:#000000;text-indent:0px;background-color:#FFFFFF;\">\r\n	<br />\r\n</p>\r\n<p style=\"color:#000000;text-indent:0px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:16px;\">而我们常见的季节性的关节痛通常就是服“温中散寒、散结消肿”这个作用，不过很多朋友一听到芥末就是呛鼻子，辣眼睛而不敢吃，其实<span style=\"color:#953734;font-size:16px;\"><strong>只要掌握正确吃法完全可以避免这种痛苦，而且达到散寒、止痛的效果，你可吃一次试试看，第二天一定会有不同程度的减轻。吃法下面会有介绍。</strong></span></span> \r\n</p>\r\n<p style=\"color:#000000;text-indent:0px;\">\r\n	<br />\r\n</p>\r\n<span style=\"font-size:18px;\">2</span><span style=\"font-size:18px;\"><strong><span style=\"line-height:1.6em;vertical-align:top;\">驱风、开胃</span></strong></span> \r\n<p style=\"color:#000000;text-indent:0px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:16px;\">芥末辣味强烈，可刺激唾液和胃液的分泌，有开胃之功效，能增强人的食欲，促进消化和驱风 ( 排除肠内气体 )，促进新陈代谢，可用于治疗食欲不振、腹胀，但是有严重胃炎的朋友不宜食用芥末，因为比较辛辣。</span> \r\n</p>\r\n<p style=\"color:#000000;text-indent:0px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:16px;\"><br />\r\n</span> \r\n</p>\r\n<span style=\"font-size:18px;\">3</span><span style=\"font-size:18px;\"><strong><span style=\"line-height:1.6em;vertical-align:top;\">降低血液粘稠度</span></strong></span> \r\n<p style=\"color:#000000;text-indent:0px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:16px;\">芥末呛鼻的主要成分是异硫氰酸盐，这种成分不但可以预防蛀牙，对防止血管凝块、治疗气喘等也有一定效果，同时还具有发汗、利尿、解毒、清血等食疗功效。</span> \r\n</p>\r\n<p style=\"color:#000000;text-indent:0px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:16px;\">芥末还有预防高血脂、高血压、心脏病、减少血液黏稠度等功效。</span> \r\n</p>\r\n<p style=\"color:#000000;text-indent:0px;\">\r\n	<br />\r\n</p>\r\n<span style=\"font-size:18px;\">4</span><span style=\"font-size:18px;\"><strong><span style=\"line-height:1.6em;vertical-align:top;\">杀菌，帮助预防食物中毒</span></strong></span> \r\n<p style=\"color:#000000;text-indent:0px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:16px;\">日本人总是把寿司蘸着芥末酱吃，这不是因为日本人多么的高大上。而是说，早年的时候，日本人常年吃生鱼，得寄生虫病的人多，这个芥末有杀菌和消灭消化系统寄生虫的作用，所以在日本得以大显身手。</span> \r\n</p>\r\n<p style=\"color:#000000;text-indent:0px;background-color:#FFFFFF;\">\r\n	<br />\r\n</p>\r\n<p style=\"color:#000000;text-indent:0px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:16px;\">芥末中含有一种名为异硫氰酸烯丙酯的元素，能够有效地杀死食物中的细菌和真菌，比如：大肠杆菌、金黄色葡萄球菌等细菌，防止食物变质，预防食物中毒，帮助解毒。</span> \r\n</p>\r\n<p style=\"color:#000000;text-indent:0px;background-color:#FFFFFF;\">\r\n	<br />\r\n</p>\r\n<span style=\"font-size:18px;\">5</span><span style=\"font-size:18px;\"><strong><span style=\"line-height:1.6em;vertical-align:top;\">帮助鼻子秒通气</span></strong></span> \r\n<p style=\"color:#000000;text-indent:0px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:16px;\">《本草经疏》说 ：“白芥子味极辛，气温。能搜剔内外痰结，及胸膈寒痰，冷涎壅塞者殊效。”虽然在身上抹上芥末让你闻起来像条生鱼片，但感冒的时候晚上鼻子不通气的话，就在睡觉前往胸口涂两汤匙芥末，鼻子下点一小点芥末，会让你一晚上呼吸顺畅。</span> \r\n</p>\r\n<p style=\"color:#000000;text-indent:0px;background-color:#FFFFFF;\">\r\n	<br />\r\n</p>\r\n<span style=\"font-size:16px;\">6</span><span style=\"font-size:18px;\"><strong><span style=\"line-height:1.6em;vertical-align:top;\">抑制引发癌症的物质</span></strong></span> \r\n<p style=\"color:#000000;text-indent:0px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:16px;\">另外，芥末还能抑制引发癌症的物质，抑制肝脏内酸化酵素的活动。目前，有些抗生素中已加入了芥末成分。目前，有些抗生素中已加入了芥末成分。</span> \r\n</p>\r\n<p style=\"color:#000000;text-indent:0px;\">\r\n	<br />\r\n</p>\r\n<p>\r\n	<span style=\"font-size:18px;\"><strong><span style=\"line-height:32px;\">注意</span></strong></span> \r\n</p>\r\n<p style=\"text-align:justify;\">\r\n	<span style=\"line-height:2em;font-size:16px;\">孕妇、消化道溃疡患者，眼睛有炎症者（因为芥末吃快了会让眼睛流泪）不宜猛食用芥末<span style=\"line-height:32px;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;\">。</span></span> \r\n</p>\r\n<p style=\"text-align:left;\">\r\n	<span style=\"font-size:18px;\"><strong><span><strong>一管十几元，吃上30天<strong><span><strong>，</strong></span></strong></strong></span></strong><strong><span>常吃常舒畅，越来越活泛</span></strong></span> \r\n</p>\r\n<p style=\"color:#000000;text-indent:0px;\">\r\n	<br />\r\n</p>\r\n<p style=\"color:#000000;text-indent:0px;\">\r\n	<br />\r\n</p>\r\n<p style=\"color:#000000;text-indent:0px;\">\r\n	<img style=\"width:auto !important;height:auto !important;\" src=\"https://mmbiz.qlogo.cn/mmbiz_jpg/IhImYwtyia80CXAsXeiaK1DvZLVOxw5KY3hS3hFDqrZlcLIDCJAFQahvHFbib4BISwn2sZxrz7e8Ar8akibY6U1fTw/640?wx_fmt=jpeg\" width=\"auto\" /> \r\n</p>\r\n<p style=\"color:#000000;text-indent:0px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:16px;\">一管芥末普通超市就有卖，十几块钱，像牙膏一样，吃多少挤多少，<span style=\"color:#7B0C00;\"><strong>一管可以吃一个多月，比膏药可便宜多了，</strong></span>还不像膏药一样，撕了又继续痛，芥末基本没副作用，长期吃，长期有用。</span> \r\n</p>\r\n<p style=\"color:#000000;text-indent:0px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:16px;\"><br />\r\n</span> \r\n</p>\r\n<p style=\"color:#000000;text-indent:0px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:18px;\"><strong><span>怎么吃呢？</span></strong></span> \r\n</p>',1487810662,NULL),(54,2,'',1,1,255,'如何使用咨询卡','<p>\r\n	<span style=\"font-size:18px;\">1.咨询卡购买成功后，点击该咨询订单，进入<span style=\"color:#337FE5;\">订单详情</span>页面。</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:18px;\">2.在订单详情页面的右下角点击<span style=\"background-color:#E53333;\">联系医生</span>的按钮，进入聊天页面。</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:18px;\">3.点击<span style=\"color:#337FE5;\">请选择聊天卡</span>，选择好后点<span style=\"color:#337FE5;\">确定</span>，即可跟医护人员进行聊天咨询。</span> \r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p class=\"p\">\r\n	<b><span style=\"background: rgb(255, 255, 255); color: rgb(229, 51, 51); font-family: ; font-size: 24px;\" class=\"15\" Times=\"\" New=\"\" Roman?;font-size:14pt;font-weight:bold;?=\"\"><span style=\"font-size:24px;\">注：在医护人员发布的服务时间段内，再点联系医生按钮，进行聊天。逾期未使用咨询卡，将作废。</span></span></b><span style=\"font-family:Calibri;font-size:14pt;\"> </span><span style=\"font-family:Calibri;font-size:14pt;\"></span> \r\n</p>\r\n<!--EndFragment-->',1488771442,NULL),(55,3,'',1,1,255,'如何兑换虚拟码','<p>\r\n	<span style=\"color:#0070C0;font-family:宋体;font-size:18pt;\"><span>一．</span></span><span style=\"color:#0070C0;font-family:宋体;font-size:18pt;\"><span>手机端兑换流程</span></span><span style=\"color:#0070C0;font-family:宋体;font-size:18pt;\"></span> \r\n</p>\r\n<p class=\"p\">\r\n	<span style=\"font-family:宋体;font-size:14pt;\">1.<span>点击</span></span><span style=\"background:#E53333;font-family:宋体;font-size:14pt;\"><span>我的订单</span></span><span style=\"font-family:宋体;font-size:14pt;\"><span>按钮，进入</span></span><span style=\"color:#0070C0;font-family:宋体;font-size:14pt;\"><span><span style=\"color:#000000;\">虚拟订单</span><span style=\"color:#000000;background-color:#FFFFFF;\"><span style=\"color:#000000;\">的</span>订单</span></span></span><span style=\"font-family:宋体;font-size:14pt;\"><span>列表页面。</span></span><span style=\"font-family:宋体;font-size:14pt;\"></span> \r\n</p>\r\n<p class=\"p\">\r\n	<span style=\"font-family:宋体;font-size:13.5pt;\">2.<span>找到需要兑换的服务订单，点击进入</span></span><span style=\"color:#0070C0;font-family:宋体;font-size:14pt;\"><span><span style=\"color:#000000;\">订单详</span><span style=\"background-color:#FFFFFF;\"></span><span style=\"color:#000000;\">情</span></span></span><span style=\"font-family:宋体;font-size:13.5pt;\"><span>页面。</span></span><span style=\"font-family:宋体;font-size:13.5pt;\"></span> \r\n</p>\r\n<p class=\"p\">\r\n	<span style=\"font-family:宋体;font-size:13.5pt;\">3.<span>点击订单详情下方的</span></span><span style=\"background:#E53333;font-family:宋体;font-size:13.5pt;\"><span>确认兑换</span></span><span style=\"font-family:宋体;font-size:13.5pt;\"><span>按钮，跳出框框后再点击确定，即可兑换成功。</span></span> \r\n</p>\r\n<p class=\"p\">\r\n	<span style=\"font-family:宋体;font-size:13.5pt;\"></span><span style=\"font-family:宋体;font-size:13.5pt;\"></span> \r\n</p>\r\n<p class=\"p\">\r\n	<span style=\"color:#0070C0;font-family:宋体;font-size:18pt;\"><span>二．电脑端兑换流程</span></span><span style=\"color:#0070C0;font-family:宋体;font-size:18pt;\"></span> \r\n</p>\r\n<p class=\"p\">\r\n	<span style=\"font-family:宋体;font-size:14pt;\">1.<span>点击<span style=\"background-color:#E53333;\">我的</span>菜单下的</span></span><span style=\"background:#E53333;font-family:宋体;font-size:13.5pt;\"><span>我的订单</span></span><span style=\"font-family:宋体;font-size:14pt;\"><span>按钮，进<span style=\"color:#000000;\">入</span></span></span><span style=\"color:#0070C0;font-family:宋体;font-size:14pt;\"><span><span style=\"color:#000000;\">虚拟订单</span><span style=\"color:#000000;\">的</span></span></span><span style=\"font-family:宋体;font-size:14pt;\"><span>订单列表页面。</span></span><span style=\"font-family:宋体;font-size:14pt;\"></span> \r\n</p>\r\n<p class=\"p\">\r\n	<span style=\"font-family:宋体;font-size:13.5pt;\">2.<span>找到需要兑换的服务订单，点击</span></span><span style=\"background:#E53333;font-family:宋体;font-size:13.5pt;\"><span>订单详情</span></span><span style=\"font-family:宋体;font-size:13.5pt;\"><span>按钮，进入页面。</span></span><span style=\"font-family:宋体;font-size:13.5pt;\"></span> \r\n</p>\r\n<p class=\"p\">\r\n	<span style=\"font-family:宋体;font-size:13.5pt;\">3.<span>点击订单详情下方的</span></span><span style=\"background:#E53333;font-family:宋体;font-size:13.5pt;\"><span>确认兑换</span></span><span style=\"font-family:宋体;font-size:13.5pt;\"><span>按钮，即可兑换成功。</span></span> \r\n</p>\r\n<p class=\"p\">\r\n	<span style=\"font-family:宋体;font-size:13.5pt;\"><span></span></span><span style=\"font-family:宋体;font-size:13.5pt;\"></span> \r\n</p>\r\n<p class=\"p\">\r\n	<b><span style=\"color:#FF0000;font-family:宋体;font-size:24px;font-weight:bold;\"><span style=\"font-size:24px;\">注：兑换码是在服务时间内确认兑换，一旦兑换成功不能退款。</span></span></b><b><span style=\"color:#FF0000;font-family:宋体;font-size:15pt;font-weight:bold;\"></span></b> \r\n</p>\r\n<p>\r\n	<!--EndFragment-->\r\n</p>',1488872208,NULL),(56,6,'',1,1,255,'如何修改个人资料','<p class=\"p\">\r\n	<span style=\"color:#0070C0;font-family:宋体;font-size:18pt;\"><span>一．手机端修改流程</span></span><span style=\"color:#0070C0;font-family:宋体;font-size:18pt;\"></span> \r\n</p>\r\n<p class=\"p\">\r\n	<span style=\"font-family:宋体;font-size:13.5pt;\">1.<span>点击</span></span><span style=\"background:#E53333;font-family:宋体;font-size:13.5pt;\"><span>我的</span></span><span style=\"font-family:宋体;font-size:13.5pt;\"><span>按钮，进入页面，在</span></span><span style=\"background:#E53333;font-family:宋体;font-size:13.5pt;\"><span>完善资料</span></span><span style=\"font-family:宋体;font-size:13.5pt;\"><span>里填写需要修改的资料，点击提交保存</span></span><span style=\"font-family:宋体;font-size:13.5pt;\"><span>按钮即修改成功。</span></span><span style=\"font-family:宋体;font-size:13.5pt;\"></span> \r\n</p>\r\n<p class=\"p\">\r\n	<span style=\"font-family:宋体;font-size:13.5pt;\">2.<span>在我的页面里，点击</span></span><span style=\"background:#E53333;font-family:宋体;font-size:13.5pt;\"><span>收</span></span><span style=\"background:#E53333;font-family:宋体;font-size:13.5pt;\"><span>货地址管理</span></span><span style=\"font-family:宋体;font-size:13.5pt;\"><span>，点击编辑或添加新地址，填写好后点击保存地址按钮。</span></span><span style=\"font-family:宋体;font-size:13.5pt;\"></span> \r\n</p>\r\n<!--EndFragment-->\r\n<p>\r\n	<br />\r\n</p>\r\n<p class=\"p\">\r\n	<span style=\"color:#0070C0;font-family:宋体;font-size:18pt;\"><span>二．电脑端修改流程</span></span><span style=\"color:#0070C0;font-family:宋体;font-size:18pt;\"></span> \r\n</p>\r\n<p class=\"p\">\r\n	<span style=\"font-family:宋体;font-size:13.5pt;\"><span>点击右上角<span style=\"background-color:#E53333;\">我的</span>菜单下的</span></span><span style=\"background:#E53333;font-family:宋体;font-size:13.5pt;\"><span>我的用户中心</span></span><span style=\"font-family:宋体;font-size:13.5pt;\"><span>按钮，在左边</span></span><span style=\"background:#E53333;font-family:宋体;font-size:13.5pt;\"><span>用户设置</span></span><span style=\"font-family:宋体;font-size:13.5pt;\"><span>列表下可以修改个人资料、收货地址、会员头像和密码等。</span></span> \r\n</p>',1489133450,NULL),(57,2,'',1,1,255,'如何分享','<span style=\"font-family:宋体;font-size:18pt;\"><span> \r\n<p class=\"p\">\r\n	<span style=\"color:#0070C0;font-family:宋体;font-size:18pt;\"><span>一．电脑端分享流程</span></span><span style=\"color:#0070C0;font-family:宋体;font-size:18pt;\"></span> \r\n</p>\r\n<!--EndFragment--></span></span> \r\n<p class=\"p\">\r\n	<span style=\"font-family:宋体;font-size:14pt;\"><span>1.</span></span><span style=\"font-family:宋体;font-size:14pt;\"><span>点击页面上方</span></span><span style=\"background:#E53333;font-family:宋体;font-size:14pt;\"><span>分享商城</span></span><span style=\"font-family:宋体;font-size:14pt;\"><span>按钮，进入逸陪康邀请中心，</span></span><span style=\"color:#0070C0;font-family:宋体;font-size:14pt;\"><span>复制邀请链接</span></span><span style=\"font-family:宋体;font-size:14pt;\"><span>，通过</span>QQ<span>、微信、微博、论坛等方式发给好友，让对方点击该链接注册即可。</span></span><span style=\"font-family:宋体;font-size:14pt;\"></span> \r\n</p>\r\n<p class=\"p\">\r\n	<span style=\"font-family:宋体;font-size:14pt;\"><span>2.</span></span><span style=\"font-family:宋体;font-size:14pt;\"><span>将逸陪康邀请中心页面里生成的</span></span><span style=\"color:#0070C0;font-family:宋体;font-size:14pt;\"><span>二维码</span></span><span style=\"font-family:宋体;font-size:14pt;\"><span>，复制图片发送给好友。让对方扫描二维码注册即可。</span></span> \r\n</p>\r\n<p class=\"p\">\r\n	<br />\r\n</p>\r\n<p class=\"p\">\r\n	<span style=\"color:#0070C0;font-family:宋体;font-size:18pt;\"><span>二．手机端分享流程</span></span><span style=\"color:#0070C0;font-family:宋体;font-size:18pt;\"></span> \r\n</p>\r\n<!--EndFragment-->\r\n<p class=\"p\">\r\n	<span style=\"font-family:宋体;font-size:14pt;\"><span>1.</span></span><span style=\"font-family:宋体;font-size:14pt;\"><span>点击</span></span><span style=\"background:#E53333;font-family:宋体;font-size:14pt;\"><span>分享商城</span></span><span style=\"font-family:宋体;font-size:14pt;\"><span>按钮，长按图片保存，再将保存好的图片，通过</span>QQ<span>、微信、微博、论坛等方式发送给好友，让对方扫描二维码注册即可。</span></span> \r\n</p>\r\n<p class=\"p\">\r\n	<span style=\"font-family:宋体;font-size:14pt;\">2.<span style=\"font-family:宋体;font-size:14pt;\"><span>通过微信的方式登陆逸陪康平台，进入分享商城页面，长按生成的二维码，选择</span></span><span style=\"color:#0070C0;font-family:宋体;font-size:14pt;\"><span>发送给朋友</span></span><span style=\"font-family:宋体;font-size:14pt;\"><span>，让对方识别图中二维码注册即可。</span></span><span style=\"font-family:宋体;font-size:14pt;\"></span> </span> \r\n</p>\r\n<!--EndFragment--><span style=\"font-family:宋体;font-size:14pt;\"></span> \r\n<p>\r\n	<!--EndFragment-->\r\n</p>',1489646431,NULL),(58,2,'',1,1,255,'如何设置支付密码','<p class=\"p\">\r\n	<span style=\"font-family:宋体;font-size:14pt;\"><span>点击</span></span><span style=\"background:#E53333;font-family:宋体;font-size:14pt;\"><span>用户设置</span></span><span style=\"font-family:宋体;font-size:14pt;\"><span>按钮，再点击</span></span><span style=\"background:#E53333;font-family:宋体;font-size:14pt;\"><span>支付密码</span></span><span style=\"font-family:宋体;font-size:14pt;\"><span>按钮，进入设置支付密码页面。将</span></span><span style=\"color:#0070C0;font-family:宋体;font-size:14pt;\"><span>打</span>*<span>号</span></span><span style=\"font-family:宋体;font-size:14pt;\"><span>的内容全部填写好，填写设置的支付密码，点击</span></span><span style=\"background:#E53333;font-family:宋体;font-size:14pt;\"><span>提交</span></span><span style=\"font-family:宋体;font-size:14pt;\"><span>即设置成功。</span></span><span style=\"font-family:宋体;font-size:14pt;\"><?xml:namespace prefix = o ns = \"urn:schemas-microsoft-com:office:office\" /></span>\r\n</p>\r\n<!--EndFragment-->',1490665173,NULL);
