INSERT INTO `document` VALUES (1,'agreement','用户服务协议','<h1 style=\"text-align:center;\" align=\"center\">\r\n	<b><span style=\"font-family:宋体;font-size:22pt;font-weight:bold;\">“逸陪康”用户版注册协议</span></b><b><span style=\"font-family:宋体;font-size:22pt;font-weight:bold;\"></span></b> \r\n</h1>\r\n<p class=\"MsoNormal\">\r\n	<span style=\"font-family:宋体;font-size:15pt;\"> </span><span style=\"font-family:宋体;font-size:12pt;\"><span>感谢您使用逸陪康客户端。使用人（指使用</span>“逸陪康”相关客户端服务的使用人，一下简称“用户”）自愿使用逸陪康，双方就相关内容达成协议。</span><span style=\"font-family:宋体;font-size:12pt;\"></span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span style=\"font-family:宋体;font-size:12pt;\"> </span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span style=\"font-family:宋体;font-size:12pt;font-weight:bold;\"><span>一、</span></span><b><span style=\"font-family:宋体;font-size:12pt;font-weight:bold;\"><span>服务条款</span></span></b><b><span style=\"font-family:宋体;font-size:12pt;font-weight:bold;\"></span></b> \r\n</p>\r\n<p style=\"text-align:justify;\" class=\"MsoNormal\" align=\"justify\">\r\n	<span style=\"font-family:宋体;font-size:12pt;\"><span>1、</span></span><span style=\"font-family:宋体;font-size:12pt;\"><span>用户统一所有注册协议条款并完成注册程序，才能成为逸陪康的正式用户。用户确认本协议条款是处理双方权利义务的契约，始终有效，法律另有强制性规定或双方另有特别规定的，依其规定。</span></span><span style=\"font-family:宋体;font-size:12pt;\"></span> \r\n</p>\r\n<p style=\"text-align:justify;\" class=\"MsoNormal\" align=\"justify\">\r\n	<span style=\"font-family:宋体;font-size:12pt;\"><span>2、</span></span><span style=\"font-family:宋体;font-size:12pt;\"><span>用户同意本协议的，即视为用户确认自己具有享有本客户端服务等相应的权利能力和行为能力，能够独立承担法律责任。</span></span><span style=\"font-family:宋体;font-size:12pt;\"></span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span style=\"font-family:宋体;font-size:12pt;font-weight:bold;\"><span>二、</span></span><b><span style=\"font-family:宋体;font-size:12pt;font-weight:bold;\"><span>隐私声明</span></span></b><b><span style=\"font-family:宋体;font-size:12pt;font-weight:bold;\"></span></b> \r\n</p>\r\n<p style=\"text-align:justify;\" class=\"MsoNormal\" align=\"justify\">\r\n	<span style=\"font-family:宋体;font-size:12pt;\"><span>1、</span></span><span style=\"font-family:宋体;font-size:12pt;\"><span>适用范围</span></span><span style=\"font-family:宋体;font-size:12pt;\"></span> \r\n</p>\r\n<p style=\"text-align:justify;\" class=\"MsoNormal\" align=\"justify\">\r\n	<span style=\"font-family:宋体;font-size:12pt;\"> <span>用户注册</span>“逸陪康”客户端时，根据网站或客户端要求提供的个人信息；</span><span style=\"font-family:宋体;font-size:12pt;\"></span> \r\n</p>\r\n<p style=\"text-align:justify;\" class=\"MsoNormal\" align=\"justify\">\r\n	<span style=\"font-family:宋体;font-size:12pt;\"><span>2、</span></span><span style=\"font-family:宋体;font-size:12pt;\"><span>信用服务</span></span><span style=\"font-family:宋体;font-size:12pt;\"></span> \r\n</p>\r\n<p style=\"text-align:justify;\" class=\"MsoNormal\" align=\"justify\">\r\n	<span style=\"font-family:宋体;font-size:12pt;\"> <span>为服务用户的目的，</span>“逸陪康”可能通过使用用户的个人信息，向用户提供服务，包括但不限于向用户发出活动和服务信息等。“逸陪康”运营方承诺非法律程序不会泄漏用户的个人数据（如姓名、身份证号、电话、住址等）。</span><span style=\"font-family:宋体;font-size:12pt;\"></span> \r\n</p>\r\n<p style=\"text-align:justify;\" class=\"MsoNormal\" align=\"justify\">\r\n	<span style=\"font-family:宋体;font-size:12pt;\">3、用户须做到</span><i><span style=\"font-family:宋体;font-size:12pt;font-style:italic;\"></span></i> \r\n</p>\r\n<p style=\"text-align:justify;text-indent:24pt;\" class=\"MsoNormal\" align=\"justify\">\r\n	<span style=\"font-family:宋体;font-size:12pt;font-style:normal;\"><span>应符合网络道德，遵守中华人民共和国的相关法律法规，不能含有威胁、淫秽、谩骂、非法、侵害他人权益等有争议性的信息资料。注册成功后，必须保护好自己的帐号和密码，因用户本人泄漏而造成的任何损失由本人负责，不得盗用他人帐号，由此行为造成的后果自负。</span></span><span style=\"font-family:宋体;font-size:12pt;font-style:normal;\"></span> \r\n</p>\r\n<p style=\"text-align:justify;\" class=\"MsoNormal\" align=\"justify\">\r\n	<span style=\"font-family:宋体;font-size:12pt;font-style:normal;\">4、逸陪康运营方保留对本政策做出不定时修改的权利。</span><span style=\"font-family:宋体;font-size:12pt;font-style:normal;\"></span> \r\n</p>\r\n<p style=\"text-align:justify;\" class=\"MsoNormal\" align=\"justify\">\r\n	<span style=\"font-family:宋体;font-size:12pt;\"> </span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span style=\"font-family:宋体;font-size:12pt;font-weight:bold;\"><span>三、</span></span><b><span style=\"font-family:宋体;font-size:12pt;font-weight:bold;\"><span>客户端服务</span></span></b><b><span style=\"font-family:宋体;font-size:12pt;font-weight:bold;\"></span></b> \r\n</p>\r\n<p style=\"text-align:justify;\" class=\"MsoNormal\" align=\"justify\">\r\n	<span style=\"font-family:宋体;font-size:12pt;\"> </span><span style=\"font-family:宋体;font-size:12pt;\"><span>本客户端服务是按照现有的技术和条件所能达到的现状提供的。运营方会尽最大努力向用户提供服务，确保服务的连贯性和安全性；但不能随时遇见和防范法律、技术以及其他风险，包括但不限于不可抗力、病毒、木马、黑客攻击、系统不稳定、第三方服务瑕疵、政府行为等原因可能导致的服务中断、数据丢失以及其他的损失和风险。</span></span><span style=\"font-family:宋体;font-size:12pt;\"></span> \r\n</p>\r\n<p style=\"text-align:justify;text-indent:30pt;\" class=\"MsoNormal\" align=\"justify\">\r\n	<span style=\"font-family:宋体;font-size:12pt;\"> </span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span style=\"font-family:宋体;font-size:12pt;font-weight:bold;\"><span>四、</span></span><b><span style=\"font-family:宋体;font-size:12pt;font-weight:bold;\"><span>服务内容</span></span></b><b><span style=\"font-family:宋体;font-size:12pt;font-weight:bold;\"></span></b> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span style=\"font-family:宋体;font-size:12pt;\"><span>1、</span></span><span style=\"font-family:宋体;font-size:12pt;\">“逸陪康”作为医疗健康信息交流互通的平台，仅向正规医疗机构的医生合作提供相关服务。用户可在平台上购买服务实现线上预约，线下由医院提供服务。同时</span><span style=\"font-family:宋体;font-size:12pt;\"><span>运营方有义务在现有技术上维护平台服务的正常进行，并努力提升技术及改进技术，使网站</span> <span>服务更好进行。</span></span><span style=\"font-family:宋体;font-size:12pt;\"></span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span style=\"font-family:宋体;font-size:12pt;\"><span>2、</span></span><span style=\"font-family:宋体;font-size:12pt;\"><span>用户服务内容不满意，可以向平台提出投诉，运营方有义务依据情况协调沟通，维护用户和医生关系和谐。</span></span><span style=\"font-family:宋体;font-size:12pt;\"></span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span style=\"font-family:宋体;font-size:12pt;\"><span>3、</span></span><span style=\"font-family:宋体;font-size:12pt;\"><span>客服电话：</span>0571-86099120</span><span style=\"font-family:宋体;font-size:12pt;\"></span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span style=\"font-family:宋体;font-size:12pt;\"> </span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span style=\"color:#FF0000;font-family:宋体;font-size:12pt;font-weight:bold;\"><span>五、</span></span><b><span style=\"color:#FF0000;font-family:宋体;font-size:12pt;font-weight:bold;\"><span>双方的权利和义务</span></span></b><b><span style=\"color:#FF0000;font-family:宋体;font-size:12pt;font-weight:bold;\"></span></b> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span style=\"color:#FF0000;font-family:宋体;font-size:12pt;\">“</span><span style=\"color:#FF0000;font-family:宋体;font-size:12pt;font-weight:normal;\"><span>逸陪康</span>”</span><span style=\"color:#FF0000;font-family:宋体;font-size:12pt;font-weight:normal;\"><span>平台的权利义务</span></span><span style=\"color:#FF0000;font-family:宋体;font-size:12pt;font-weight:normal;\"></span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span style=\"color:#FF0000;font-family:宋体;font-size:12pt;font-weight:normal;\"><span>1、</span></span><span style=\"color:#FF0000;font-family:宋体;font-size:12pt;font-weight:normal;\"><span>平台有自主制定管理制度的权利</span></span><span style=\"color:#FF0000;font-family:宋体;font-size:12pt;font-weight:normal;\"></span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span style=\"color:#FF0000;font-family:宋体;font-size:12pt;font-weight:normal;\"><span>2、</span></span><span style=\"color:#FF0000;font-family:宋体;font-size:12pt;font-weight:normal;\"><span>平台有对相关医疗机构进行商业推广、产品宣传并收取一定费用的权利</span></span><span style=\"color:#FF0000;font-family:宋体;font-size:12pt;font-weight:normal;\"></span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span style=\"color:#FF0000;font-family:宋体;font-size:12pt;font-weight:normal;\"><span>3、</span></span><span style=\"color:#FF0000;font-family:宋体;font-size:12pt;font-weight:normal;\"><span>平台有视情况对客户端用户收取一定注册费用或服务费用的权利</span></span><span style=\"color:#FF0000;font-family:宋体;font-size:12pt;font-weight:normal;\"></span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span style=\"color:#FF0000;font-family:宋体;font-size:12pt;font-weight:normal;\"><span>4、</span></span><span style=\"color:#FF0000;font-family:宋体;font-size:12pt;font-weight:normal;\"><span>平台有随时关闭违规客户端帐号的权利</span></span><span style=\"color:#FF0000;font-family:宋体;font-size:12pt;font-weight:normal;\"></span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span style=\"color:#FF0000;font-family:宋体;font-size:12pt;font-weight:normal;\"><span>5、</span></span><span style=\"color:#FF0000;font-family:宋体;font-size:12pt;font-weight:normal;\"><span>平台保证合法经营义务，并通过</span></span><span style=\"color:#FF0000;font-family:宋体;font-size:12pt;font-weight:normal;\"><span>国家相关部门批</span></span><span style=\"color:#FF0000;font-family:宋体;font-size:12pt;\"><span>准，依法设立，并取得相关经营许可证书</span></span><span style=\"color:#FF0000;font-family:宋体;font-size:12pt;\"></span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span style=\"color:#FF0000;font-family:宋体;font-size:12pt;\"><span>6、</span></span><span style=\"color:#FF0000;font-family:宋体;font-size:12pt;\"><span>平台有对用户端所提供的所有私人信息，包括但不限于姓名、身份证号、家庭住址等信息进行保密的义务</span></span><span style=\"color:#FF0000;font-family:宋体;font-size:12pt;\"></span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span style=\"color:#FF0000;font-family:宋体;font-size:12pt;\"><span>7、</span></span><span style=\"color:#FF0000;font-family:宋体;font-size:12pt;\"><span>平台对于用户对所入驻的医疗机构的医疗、服务评价有如实公布的义务</span></span><span style=\"color:#FF0000;font-family:宋体;font-size:12pt;\"></span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span style=\"color:#FF0000;font-family:宋体;font-size:12pt;\"><span>用户的权利义务</span></span><span style=\"color:#FF0000;font-family:宋体;font-size:12pt;\"></span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span style=\"color:#FF0000;font-family:宋体;font-size:12pt;\"><span>1、</span></span><span style=\"color:#FF0000;font-family:宋体;font-size:12pt;\"><span>用户经注册后有查看平台上所有医疗机构、医护人员信息的权利</span></span><span style=\"color:#FF0000;font-family:宋体;font-size:12pt;\"></span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span style=\"color:#FF0000;font-family:宋体;font-size:12pt;\"><span>2、</span></span><span style=\"color:#FF0000;font-family:宋体;font-size:12pt;\"><span>用户根据等级享有平台上特定功能服务的权利</span></span><span style=\"color:#FF0000;font-family:宋体;font-size:12pt;\"></span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span style=\"color:#FF0000;font-family:宋体;font-size:12pt;\"><span>3、</span></span><span style=\"color:#FF0000;font-family:宋体;font-size:12pt;\"><span>用户有对平台上的医疗机构、医护人员进行评价的权利</span></span><span style=\"color:#FF0000;font-family:宋体;font-size:12pt;\"></span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span style=\"color:#FF0000;font-family:宋体;font-size:12pt;\"><span>4、</span></span><span style=\"color:#FF0000;font-family:宋体;font-size:12pt;\"><span>用户根据等级有支付费用的义务</span></span><span style=\"color:#FF0000;font-family:宋体;font-size:12pt;\"></span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span style=\"color:#FF0000;font-family:宋体;font-size:12pt;\"><span>5、</span></span><span style=\"color:#FF0000;font-family:宋体;font-size:12pt;\"><span>用户有严格遵守平台的所有管理制度的义务</span></span><span style=\"color:#FF0000;font-family:宋体;font-size:12pt;\"></span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span style=\"color:#FF0000;font-family:宋体;font-size:12pt;\"><span>6、</span></span><span style=\"color:#FF0000;font-family:宋体;font-size:12pt;\"><span>用户有如实提供个人信息的义务</span></span><span style=\"color:#FF0000;font-family:宋体;font-size:12pt;\"></span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><span style=\"font-family:宋体;font-size:12pt;font-weight:bold;\"><span>六、免责条款</span></span></b><b><span style=\"font-family:宋体;font-size:12pt;font-weight:bold;\"></span></b> \r\n</p>\r\n<p style=\"text-align:justify;\" class=\"MsoNormal\" align=\"justify\">\r\n	<span style=\"font-family:宋体;font-size:12pt;\"><span>1、</span></span><span style=\"font-family:宋体;font-size:12pt;\"><span>逸陪康客户端所有信息仅供参考，不作为个别诊断、用药和使用的依据。逸陪康服务平台致力于尽量提供正确、完整的健康资讯，但不保证信息的绝对正确性和完整性，且不对因信息的不正确或遗漏导致的任何损失或损害承担责任。逸陪康所展现的任何医药资讯，仅供参考，如自行使用逸陪康所展现资料发生偏差，逸陪康不承担任何法律责任。</span></span><span style=\"font-family:宋体;font-size:12pt;\"></span> \r\n</p>\r\n<p style=\"text-align:justify;\" class=\"MsoNormal\" align=\"justify\">\r\n	<span style=\"font-family:宋体;font-size:12pt;\"><span>2、</span></span><span style=\"font-family:宋体;font-size:12pt;\"><span>逸陪康致力于打造新型移动智慧互联网平台，平台运营方对逸陪康客户端得到的任何相关的诊疗、电子处方、咨询等不担保治疗效果。对此产生的医疗后果，不承担任何法律责任。</span></span><span style=\"font-family:宋体;font-size:12pt;\"></span> \r\n</p>\r\n<p style=\"text-align:justify;\" class=\"MsoNormal\" align=\"justify\">\r\n	<span style=\"color:#FF0000;font-family:宋体;font-size:12pt;\">3、</span><span style=\"color:#FF0000;font-family:宋体;font-size:12pt;\">“逸陪康”服务平台属于居间性质，仅为医患双方提供信息对接服务，促成医患双方进行医疗服务，平台不参与医患双方的医疗、治疗服务关系，平台也不提供任何具体的医疗、治疗服务，本平台上的客户端用户和平台上所入驻的医护人员或者医疗机构因医疗、治疗服务发生的任何纠纷，由用户自行处理，平台不介入也不须承担任何法律责任，本平台可以为双方纠纷的进行必要的调解，调解不成的，不影响双方按照法律规定处理。</span><span style=\"font-family:宋体;font-size:12pt;\"></span> \r\n</p>\r\n<p style=\"text-align:justify;\" class=\"MsoNormal\" align=\"justify\">\r\n	<span style=\"font-family:宋体;font-size:12pt;\"> </span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><span style=\"font-family:宋体;font-size:12pt;font-weight:bold;\"><span>七、法律管辖和适用</span></span></b><b><span style=\"font-family:宋体;font-size:12pt;font-weight:bold;\"></span></b> \r\n</p>\r\n<p style=\"text-align:justify;\" class=\"MsoNormal\" align=\"justify\">\r\n	<span style=\"font-family:宋体;font-size:12pt;\"> <span>本协议的订立、执行和解释及争议的解决均应适用于在中华人民共和国大陆地区适用之有效法律（但不包括其冲突法规法则）。</span><span>如发生本协议与适用之法律相抵触时，则这些条款将完全按法律法规重新解释，而其它有效条款继续有效。如缔约方就本协议内容或其执行发生任何争议，双方应尽力友好协商解决，协商不成时，任何一方均可向有管辖权的中华人民共和国大陆地区法院提起诉讼。</span></span><span style=\"font-family:宋体;font-size:12pt;\"></span> \r\n</p>\r\n<p style=\"text-align:justify;\" class=\"MsoNormal\" align=\"justify\">\r\n	<span style=\"font-family:宋体;font-size:12pt;\"> </span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><span style=\"font-family:宋体;font-size:12pt;font-weight:bold;\"><span>八、其他</span></span></b><b><span style=\"font-family:宋体;font-size:12pt;font-weight:bold;\"></span></b> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span style=\"font-family:宋体;font-size:12pt;\"><span>用户注册使用本客户端即视为用户完全接受本协议，请用户再次确认已知悉并完全理解本协议的全部内容。</span></span><span style=\"font-family:宋体;font-size:12pt;\"></span> \r\n</p>\r\n<p>\r\n	<!--EndFragment-->\r\n</p>',1489132950),(4,'open_store','医护人员注册协议','<h1 style=\"text-align:left;text-indent:44pt;\">\r\n	<b><span style=\"font-family:宋体;font-size:22pt;font-weight:bold;\">“逸陪康”</span></b><b><span style=\"font-family:宋体;font-size:22pt;font-weight:bold;\"><span>医护版注册服务协议</span></span></b><b><span style=\"font-family:宋体;font-size:22pt;font-weight:bold;\"><?xml:namespace prefix = o ns = \"urn:schemas-microsoft-com:office:office\" /></span></b>\r\n</h1>\r\n<p class=\"MsoNormal\">\r\n	<b><span style=\"font-family:宋体;font-size:14pt;font-weight:bold;\">&nbsp;&nbsp;</span></b><b><span style=\"font-family:宋体;font-size:14pt;font-weight:bold;\">“逸陪康”服务协议</span></b><b><span style=\"font-family:宋体;font-size:14pt;font-weight:bold;\"></span></b>\r\n</p>\r\n<p style=\"text-indent:21pt;\" class=\"MsoNormal\">\r\n	<span style=\"font-family:宋体;font-size:10.5pt;\"><span>首先感谢您使用</span>“逸陪康”网页</span><span style=\"font-family:宋体;font-size:10.5pt;\"><span>版</span></span><span style=\"font-family:宋体;font-size:10.5pt;\"><span>平台。</span></span><span style=\"font-family:宋体;font-size:10.5pt;\">“逸陪康”平台（以下简称“逸陪康”），是杭州逸马健康管理有限公司（以下简称“逸马健康”）专门为具有一定资格的医生、护士团队开发的一款就诊移动医疗应用平台。医护人员可以使用该平台对已熟悉或诊断过的患者用户进行在线预约就诊、线上交流、咨询和随访管理等工作。“逸陪康”是为医患交流搭建的一个和谐、便捷、高效的沟通平台。在注册成为“逸陪康”国家认可资质的医护人员、使用“逸陪康”应用平台之前，医生需要确认已经阅读本协议，并同意本协议中所有条款。一旦您开始使用“逸陪康”并通过平台相关资质审核后，即视为本协议中的所有条款生效。</span><span style=\"font-family:宋体;font-size:10.5pt;\"></span>\r\n</p>\r\n<p class=\"16\">\r\n	<span style=\"font-family:宋体;font-size:12pt;font-weight:bold;\"><span>一、</span></span><b><span style=\"font-family:宋体;font-size:12pt;font-weight:bold;\"><span>总则</span></span></b><b><span style=\"font-family:宋体;font-size:12pt;font-weight:bold;\"></span></b>\r\n</p>\r\n<p style=\"text-indent:21pt;\" class=\"MsoNormal\">\r\n	<span style=\"font-family:宋体;font-size:10.5pt;\"><span>1.</span></span><span style=\"font-family:宋体;font-size:10.5pt;\">“逸陪康”作为医疗健康交流互通平台，为您提供相关服务。为确保您能正常地使用“逸陪康”的服务，您应当阅读并遵守《“逸陪康”服务协议》（以下简称“本协议”）。请您务必审慎阅读、充分理解各条款内容，特别是免除或限制责任的相应条款，以及开通或使用某项服务的单独协议，并选择接受或不接受。</span><span style=\"font-family:宋体;font-size:10.5pt;\"></span>\r\n</p>\r\n<p style=\"text-indent:21pt;\" class=\"MsoNormal\">\r\n	<span style=\"font-family:宋体;font-size:10.5pt;\"><span>2.</span></span><span style=\"font-family:宋体;font-size:10.5pt;\"><span>除非您已阅读并接受本协议所有条款，否则您无权使用</span>“逸陪康”的服务（一下简称“本服务”）。您对本服务的登陆、查看、发布信息等行为即视为您已阅读并同意本协议的约束，包括接受更新后的本协议条款。当您与本平台发生争议时，应以最新的服务协议为准。</span><span style=\"font-family:宋体;font-size:10.5pt;\"></span>\r\n</p>\r\n<p style=\"text-indent:21pt;\" class=\"MsoNormal\">\r\n	<span style=\"font-family:宋体;font-size:10.5pt;\"><span>3.</span></span><span style=\"font-family:宋体;font-size:10.5pt;\">“逸陪康”为您提供全面的医疗健康服务，为充分保护您对于“逸陪康”提供的各项服务的知情权，“逸陪康”就其提供的各项服务的相关性、有效性以及限制性提供一下注册条款。“逸陪康”在此特别提醒您，在您使用注册前已确实仔细阅读了本服务协议，如果您对本协议的任何条款或者将来随时可能修改、补充的条款有异议，您可选择不注册成为“逸陪康”的用户。</span><span style=\"font-family:宋体;font-size:10.5pt;\"></span>\r\n</p>\r\n<p style=\"text-indent:21pt;\" class=\"MsoNormal\">\r\n	<span style=\"color:#FF0000;font-family:宋体;font-size:10.5pt;\"><span>4.</span></span><span style=\"color:#FF0000;font-family:宋体;font-size:10.5pt;\"><span>您在进行注册过程中，根据文字或图形提示可以选择表示</span>“同意”的操作，当您点选“同意”按钮时即视为您已阅读本协议，同意接受本协议项下的所有条款，包括接受“逸陪康”对本协议条款随时所做的任何修改，并愿意受其约束。之后可能按系统提示完成全部注册程序、问答程序、享受挂号服务及医疗健康信息服务程序。</span><span style=\"color:#FF0000;font-family:宋体;font-size:10.5pt;\"></span>\r\n</p>\r\n<p style=\"text-indent:21pt;\" class=\"MsoNormal\">\r\n	<span style=\"font-family:宋体;font-size:10.5pt;\"><span>5.</span></span><span style=\"font-family:宋体;font-size:10.5pt;\"><span>您在</span>“逸陪康”挂号、提问、搜索、提供医疗健康信息、与其他用户交流及其他健康类服务，即代表您已经同意本协议。</span><span style=\"font-family:宋体;font-size:10.5pt;\"></span>\r\n</p>\r\n<p style=\"text-indent:21pt;\" class=\"MsoNormal\">\r\n	<span style=\"font-family:宋体;font-size:10.5pt;\"><span>6.</span></span><span style=\"font-family:宋体;font-size:10.5pt;\"><span>本协议与《免责条款》具备同等的法律效力。本协议的条款适用于</span>“逸陪康”提供的各种服务。但当您使用“逸陪康”的某一特定服务时，如该服务另有单独的服务条款、指引或规则，您应遵守本协议及“逸陪康”随时公布的与该服务相关的服务条款、指引或规则等。前述所有的指引和规则，均构成本协议的一部分。除非本协议另有其他明示规定，新推出的产品或服务、增加或强化目前本服务的任何新功能，均受本协议之规范。</span><span style=\"font-family:宋体;font-size:10.5pt;\"></span>\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span style=\"font-family:宋体;font-size:10.5pt;\">&nbsp;</span>\r\n</p>\r\n<p class=\"16\">\r\n	<span style=\"font-family:宋体;font-size:12pt;font-weight:bold;\"><span>二、</span></span><b><span style=\"font-family:宋体;font-size:12pt;font-weight:bold;\"><span>服务简介</span></span></b><b><span style=\"font-family:宋体;font-size:12pt;font-weight:bold;\"></span></b>\r\n</p>\r\n<p style=\"text-indent:21pt;\" class=\"MsoNormal\">\r\n	<span style=\"font-family:宋体;font-size:10.5pt;\">1.<span>“逸陪康”作为医疗健康信息交流互通的平台为仅向正规医疗机构的医生提供相关服务。因此，您必须是合法登记、已获得相应执业证书或具备同等资质的医护人员。若不符合本项条件，请勿使用本服务，</span></span><span style=\"font-family:宋体;font-size:10.5pt;\">“逸陪康”随时自行全权决定拒绝向任何人士提供本服务<span>,</span><span>本服务不会提供被暂时或永久终止资格的本平台会员。</span></span><span style=\"font-family:宋体;font-size:10.5pt;\"></span>\r\n</p>\r\n<p style=\"text-align:justify;text-indent:21pt;\" class=\"MsoNormal\" align=\"justify\">\r\n	<span style=\"font-family:宋体;font-size:10.5pt;\">2.<span>“逸陪康”运营方运用自己的操作系统通过微信公众平台为您提供“逸陪康”的平台服务，并承担本协议和其他服务协议中对您的责任和义务。为使用本服务，您必须能够自行通过有法律资格的第三方为您提供互联网接入服务，并自行承担以下内容：</span></span><span style=\"font-family:宋体;font-size:10.5pt;\"></span>\r\n</p>\r\n<p style=\"text-align:justify;text-indent:21pt;\" class=\"MsoNormal\" align=\"justify\">\r\n	<span style=\"font-family:宋体;font-size:10.5pt;\"><span>（1）</span></span><span style=\"font-family:宋体;font-size:10.5pt;\"><span>自行配备具有微信、网页浏览器功能的手机或电脑</span></span><span style=\"font-family:宋体;font-size:10.5pt;\"></span>\r\n</p>\r\n<p style=\"text-align:justify;text-indent:21pt;\" class=\"MsoNormal\" align=\"justify\">\r\n	<span style=\"font-family:宋体;font-size:10.5pt;\"><span>（2）</span></span><span style=\"font-family:宋体;font-size:10.5pt;\"><span>自行承担上网所需的相关必要费用，如：手机话费、网络费用等</span></span><span style=\"font-family:宋体;font-size:10.5pt;\"></span>\r\n</p>\r\n<p style=\"text-align:justify;text-indent:21pt;\" class=\"MsoNormal\" align=\"justify\">\r\n	<span style=\"font-family:宋体;font-size:10.5pt;\"><span>（3）</span></span><span style=\"font-family:宋体;font-size:10.5pt;\"><span>本协议中规定的您的其他责任和义务</span></span><span style=\"font-family:宋体;font-size:10.5pt;\"></span>\r\n</p>\r\n<p style=\"text-align:justify;text-indent:21pt;\" class=\"MsoNormal\" align=\"justify\">\r\n	<span style=\"font-family:宋体;font-size:10.5pt;\"><span>3.</span></span><span style=\"font-family:宋体;font-size:10.5pt;\"><span>您应保证：提供详尽、真实、准确和完整的个人资料。</span></span><span style=\"font-family:宋体;font-size:10.5pt;\"><span>如果资料发送变动，您应及时在平台上进行修改。若您提供任何错误、不真实、过时或不完整的资料，并为</span>“逸陪康”所确知；或者“逸陪康”有合理理由怀疑前述资料为错误、不实、过时或不完整的资料，“逸陪康”有权暂停或终止您的账号，并拒绝现在或将来使用本服务的全部或一部分。在此情况下，您可通过“逸陪康”的申述途径与“逸陪康”工作人员取得联系并修改个人资料经“逸陪康”核实后恢复账号使用。</span><span style=\"font-family:宋体;font-size:10.5pt;\"></span>\r\n</p>\r\n<p style=\"text-align:justify;text-indent:21pt;\" class=\"MsoNormal\" align=\"justify\">\r\n	<span style=\"color:#FF0000;font-family:宋体;font-size:10.5pt;\"><span>4.</span></span><span style=\"color:#FF0000;font-family:宋体;font-size:10.5pt;\"><span>医护人员可在平台上发布力所能及的服务，平台的售价会在医护人员标价的基础上根据实际平台的运营情况增倍，医护人员可拿自己标价的</span>60%<span>提成。</span></span><span style=\"color:#FF0000;font-family:宋体;font-size:10.5pt;\"></span>\r\n</p>\r\n<p style=\"text-align:justify;text-indent:21pt;\" class=\"MsoNormal\" align=\"justify\">\r\n	<span style=\"color:#FF0000;font-family:宋体;font-size:10.5pt;\"><span>5.</span></span><span style=\"color:#FF0000;font-family:宋体;font-size:10.5pt;\"><span>医护人员应保证自己推荐的医护人员具有合法的医师或护士资格，如发现推荐的医护人员不符合本平台的规定，需及时告知客服人员。</span></span><span style=\"color:#FF0000;font-family:宋体;font-size:10.5pt;\"></span>\r\n</p>\r\n<p style=\"text-align:justify;\" class=\"MsoNormal\" align=\"justify\">\r\n	<span style=\"font-family:宋体;font-size:10.5pt;\">&nbsp;</span>\r\n</p>\r\n<p class=\"16\">\r\n	<span style=\"font-family:宋体;font-size:12pt;font-weight:bold;\"><span>三、</span></span><b><span style=\"font-family:宋体;font-size:12pt;font-weight:bold;\"><span>服务暂停、变更与终止条款</span></span></b><b><span style=\"font-family:宋体;font-size:12pt;font-weight:bold;\"></span></b>\r\n</p>\r\n<p style=\"text-align:justify;text-indent:21pt;\" class=\"MsoNormal\" align=\"justify\">\r\n	<span style=\"font-family:宋体;font-size:10.5pt;\"><span>1.</span></span><span style=\"font-family:宋体;font-size:10.5pt;\"><span>鉴于移动互联网服务的特殊性，</span>“逸陪康”有权随时变更、中断或终止部分或全部的服务。如变更、中断或终止的服务属于免费服务，“逸陪康”无需通知您，也无需对您或任何第三方承担任何责任。</span><span style=\"font-family:宋体;font-size:10.5pt;\"></span>\r\n</p>\r\n<p style=\"text-align:justify;text-indent:21pt;\" class=\"MsoNormal\" align=\"justify\">\r\n	<span style=\"font-family:宋体;font-size:10.5pt;\"><span>2.</span></span><span style=\"font-family:宋体;font-size:10.5pt;\"><span>需要您理解，</span>“逸陪康”需要定期或不定期地对提供本服务的平台或相关的设备进行检修或者维护，如因此类情况而造成本服务在合理时间内的中断，“逸陪康”无需为此承担任何责任，但“逸陪康”应尽可能事先进行通告。</span><span style=\"font-family:宋体;font-size:10.5pt;\"></span>\r\n</p>\r\n<p style=\"text-align:justify;text-indent:21pt;\" class=\"MsoNormal\" align=\"justify\">\r\n	<span style=\"font-family:宋体;font-size:10.5pt;\"><span>3.</span></span><span style=\"font-family:宋体;font-size:10.5pt;\"><span>如发生下列任何一种情况，</span>“逸陪康”有权随时中断或终止向您提供本协议项下的服务，而无需对您或任何第三方承担任何责任：</span><span style=\"font-family:宋体;font-size:10.5pt;\"></span>\r\n</p>\r\n<p style=\"text-align:justify;text-indent:21pt;\" class=\"MsoNormal\" align=\"justify\">\r\n	<span style=\"font-family:宋体;font-size:10.5pt;\"><span>(1)</span></span><span style=\"font-family:宋体;font-size:10.5pt;\"><span>您提供的个人资料不真实；</span></span><span style=\"font-family:宋体;font-size:10.5pt;\"></span>\r\n</p>\r\n<p style=\"text-align:justify;text-indent:21pt;\" class=\"MsoNormal\" align=\"justify\">\r\n	<span style=\"font-family:宋体;font-size:10.5pt;\"><span>(2)</span></span><span style=\"font-family:宋体;font-size:10.5pt;\"><span>您违反本协议中的规定；</span></span><span style=\"font-family:宋体;font-size:10.5pt;\"></span>\r\n</p>\r\n<p style=\"text-align:justify;text-indent:21pt;\" class=\"MsoNormal\" align=\"justify\">\r\n	<span style=\"font-family:宋体;font-size:10.5pt;\"><span>(3)</span></span><span style=\"font-family:宋体;font-size:10.5pt;\"><span>您违反</span>“逸陪康”发布的政策；</span><span style=\"font-family:宋体;font-size:10.5pt;\"></span>\r\n</p>\r\n<p style=\"text-align:justify;text-indent:21pt;\" class=\"MsoNormal\" align=\"justify\">\r\n	<span style=\"font-family:宋体;font-size:10.5pt;\"><span>(4)</span></span><span style=\"font-family:宋体;font-size:10.5pt;\">“逸陪康”认为其他不适宜的地方；</span><span style=\"font-family:宋体;font-size:10.5pt;\"></span>\r\n</p>\r\n<p style=\"text-align:justify;\" class=\"MsoNormal\" align=\"justify\">\r\n	<span style=\"font-family:宋体;font-size:10.5pt;\">&nbsp;</span>\r\n</p>\r\n<p class=\"16\">\r\n	<span style=\"font-family:宋体;font-size:12pt;font-weight:bold;\"><span>四、</span></span><b><span style=\"font-family:宋体;font-size:12pt;font-weight:bold;\"><span>您的账号、密码和安全性</span></span></b><b><span style=\"font-family:宋体;font-size:12pt;font-weight:bold;\"></span></b>\r\n</p>\r\n<p style=\"text-align:justify;text-indent:21pt;\" class=\"MsoNormal\" align=\"justify\">\r\n	<span style=\"font-family:宋体;font-size:10.5pt;\"><span>1.</span></span><span style=\"font-family:宋体;font-size:10.5pt;\"><span>您一旦注册成功，成为</span>“逸陪康”的合法用户，将得到一个您设定的账号和密码。您的账号和密码由您负责保管。您要对您账号进行的所有活动和事件负全责，若发现任何非法使用您账号或存在安全漏洞的情况，请立即通知“逸陪康”客服人员。</span><span style=\"font-family:宋体;font-size:10.5pt;\"></span>\r\n</p>\r\n<p style=\"text-align:justify;text-indent:21pt;\" class=\"MsoNormal\" align=\"justify\">\r\n	<span style=\"font-family:宋体;font-size:10.5pt;\"><span>2.</span></span><span style=\"font-family:宋体;font-size:10.5pt;\"><span>若因</span></span><span style=\"font-family:宋体;font-size:10.5pt;\"><span>黑客行为</span></span><span style=\"font-family:宋体;font-size:10.5pt;\"><span>或您的保管疏忽等情况导致账号、密码遭其他人非法使用，</span>“逸陪康”不承担责任。</span><span style=\"font-family:宋体;font-size:10.5pt;\"></span>\r\n</p>\r\n<p style=\"text-align:justify;\" class=\"MsoNormal\" align=\"justify\">\r\n	<span style=\"font-family:宋体;font-size:10.5pt;\">&nbsp;</span>\r\n</p>\r\n<p class=\"16\">\r\n	<span style=\"font-family:宋体;font-size:12pt;font-weight:bold;\"><span>五、</span></span><b><span style=\"font-family:宋体;font-size:12pt;font-weight:bold;\"><span>隐私保护</span></span></b><b><span style=\"font-family:宋体;font-size:12pt;font-weight:bold;\"></span></b>\r\n</p>\r\n<p style=\"text-align:justify;text-indent:21pt;\" class=\"MsoNormal\" align=\"justify\">\r\n	<span style=\"font-family:宋体;font-size:10.5pt;\"><span>1.</span></span><span style=\"font-family:宋体;font-size:10.5pt;\"><span>保护您的隐私是</span>“逸陪康”的一项基本政策，“逸陪康”保证不对外公开或向第三方提供您的注册资料及您在使用本服务时存储在“逸陪康”的非公开内容，但下列情况除外：</span><span style=\"font-family:宋体;font-size:10.5pt;\"></span>\r\n</p>\r\n<p style=\"text-align:justify;text-indent:21pt;\" class=\"MsoNormal\" align=\"justify\">\r\n	<span style=\"font-family:宋体;font-size:10.5pt;\"><span>（1）</span></span><span style=\"font-family:宋体;font-size:10.5pt;\"><span>事先获得您的明确授权；</span></span><span style=\"font-family:宋体;font-size:10.5pt;\"></span>\r\n</p>\r\n<p style=\"text-align:justify;text-indent:21pt;\" class=\"MsoNormal\" align=\"justify\">\r\n	<span style=\"font-family:宋体;font-size:10.5pt;\"><span>（2）</span></span><span style=\"font-family:宋体;font-size:10.5pt;\"><span>根据有关法律法规要求；</span></span><span style=\"font-family:宋体;font-size:10.5pt;\"></span>\r\n</p>\r\n<p style=\"text-align:justify;text-indent:21pt;\" class=\"MsoNormal\" align=\"justify\">\r\n	<span style=\"font-family:宋体;font-size:10.5pt;\"><span>（3）</span></span><span style=\"font-family:宋体;font-size:10.5pt;\"><span>按照相关政府主管部门的要求；</span></span><span style=\"font-family:宋体;font-size:10.5pt;\"></span>\r\n</p>\r\n<p style=\"text-align:justify;text-indent:21pt;\" class=\"MsoNormal\" align=\"justify\">\r\n	<span style=\"font-family:宋体;font-size:10.5pt;\"><span>（4）</span></span><span style=\"font-family:宋体;font-size:10.5pt;\"><span>为维护社会公众的利益；</span></span><span style=\"font-family:宋体;font-size:10.5pt;\"></span>\r\n</p>\r\n<p style=\"text-align:justify;text-indent:21pt;\" class=\"MsoNormal\" align=\"justify\">\r\n	<span style=\"color:#FF0000;font-family:宋体;font-size:10.5pt;\"><span>（5）</span></span><span style=\"color:#FF0000;font-family:宋体;font-size:10.5pt;\"><span>为维护已赔款的合法权益；</span></span><span style=\"color:#FF0000;font-family:宋体;font-size:10.5pt;\"></span>\r\n</p>\r\n<p style=\"text-align:justify;text-indent:21pt;\" class=\"MsoNormal\" align=\"justify\">\r\n	<span style=\"font-family:宋体;font-size:10.5pt;\"><span>2.</span></span><span style=\"font-family:宋体;font-size:10.5pt;\">“逸陪康”可能会与第三方合作向您提供的网络服务，在此情况下，您同意授权“逸陪康”将您的注册资料等提供给该第三方。</span><span style=\"font-family:宋体;font-size:10.5pt;\"></span>\r\n</p>\r\n<p style=\"text-align:justify;text-indent:21pt;\" class=\"MsoNormal\" align=\"justify\">\r\n	<span style=\"font-family:宋体;font-size:10.5pt;\"><span>3.</span></span><span style=\"font-family:宋体;font-size:10.5pt;\"><span>在不透露您隐私资料的前提下，您同意</span>“逸陪康”对您的数据库进行分析并对您数据库进行商业上的利用，包括出售您数据库中的信息。</span><span style=\"font-family:宋体;font-size:10.5pt;\"></span>\r\n</p>\r\n<p style=\"text-align:justify;text-indent:21pt;\" class=\"MsoNormal\" align=\"justify\">\r\n	<span style=\"font-family:宋体;font-size:10.5pt;\"><span>4.</span></span><span style=\"font-family:宋体;font-size:10.5pt;\"><span>对于您在享受服务过程中获得的第三方信息或资料（包括但不限于用户信息、用户健康资料以及用于存储在</span>“逸陪康”的仅向您公开的信息内容），您仅能用于解决该用户问题、在用户同意的特定事项中或用户的授权范围内使用。您不得用于其他用途、想其他第三方进行公开、透露或授权其他第三方进行使用。</span><span style=\"font-family:宋体;font-size:10.5pt;\"></span>\r\n</p>\r\n<p style=\"text-align:justify;\" class=\"MsoNormal\" align=\"justify\">\r\n	<span style=\"font-family:宋体;font-size:10.5pt;\">&nbsp;</span>\r\n</p>\r\n<p class=\"16\">\r\n	<span style=\