ont-size:10.5pt;\"></span>\r\n</p>\r\n<p style=\"text-align:justify;text-indent:21pt;\" class=\"MsoNormal\" align=\"justify\">\r\n	<span style=\"font-family:宋体;font-size:10.5pt;\"><span>3.</span></span><span style=\"font-family:宋体;font-size:10.5pt;\">“逸陪康”因受合作医疗机构等资源限制，就您所提供预约挂号等请求不担保服务一定能成功。</span><span style=\"font-family:宋体;font-size:10.5pt;\"></span>\r\n</p>\r\n<p style=\"text-align:justify;text-indent:21pt;\" class=\"MsoNormal\" align=\"justify\">\r\n	<span style=\"font-family:宋体;font-size:10.5pt;\"><span>4.</span></span><span style=\"font-family:宋体;font-size:10.5pt;\">“逸陪康”在微信平台上得到的任何有关健康的咨询意见、用药情况的保证效果等，不做担保。</span><span style=\"font-family:宋体;font-size:10.5pt;\"></span>\r\n</p>\r\n<p style=\"text-align:justify;\" class=\"MsoNormal\" align=\"justify\">\r\n	<span style=\"font-family:宋体;font-size:10.5pt;\">&nbsp;</span>\r\n</p>\r\n<p class=\"16\">\r\n	<span style=\"font-family:宋体;font-size:12pt;font-weight:bold;\"><span>九、</span></span><b><span style=\"font-family:宋体;font-size:12pt;font-weight:bold;\"><span>免责条款</span></span></b><b><span style=\"font-family:宋体;font-size:12pt;font-weight:bold;\"></span></b>\r\n</p>\r\n<p style=\"text-align:justify;text-indent:21pt;\" class=\"MsoNormal\" align=\"justify\">\r\n	<span style=\"font-family:宋体;font-size:10.5pt;\"><span>1.</span></span><span style=\"font-family:宋体;font-size:10.5pt;\">“逸陪康”对您使用网络服务而受到的任何直接、间接、偶然、特殊及继起的损害（“逸陪康”违反法律、法规和本协议的条款除外）不负责任，这些损害可能来自：不正当使用网络服务，私自在网上进行交易，非法使用网络服务后您传送的信息有所变动。这些行为都可能会导致“逸陪康”的形象受损，所以“逸陪康”事先提出这些损害的可能。因发生火灾、水灾、暴动、骚乱、战争等不可抗拒事故，“逸陪康”所不能控制的事件而影响“逸陪康”提供服务，“逸陪康”无需承担任何责任。</span><span style=\"font-family:宋体;font-size:10.5pt;\"></span>\r\n</p>\r\n<p style=\"text-align:justify;text-indent:21pt;\" class=\"MsoNormal\" align=\"justify\">\r\n	<span style=\"font-family:宋体;font-size:10.5pt;\"><span>2.</span></span><span style=\"font-family:宋体;font-size:10.5pt;\">“逸陪康”所有信息仅供参考，不做个别诊断、用药和使用的依据。“逸陪康”作为医疗健康交互平台，致力于尽量提供正确、完整的健康资讯，但不保证信息的绝对正确性和完整性，且不对因信息的不正确或遗漏导致的任何损失或损害承担着责任。“逸陪康”所展现的任何医药资讯，仅供参考，不能替代医生和其他医护人员的建议，如自行使用“逸陪康”资料发生偏差，“逸陪康”不承担任何法律责任。</span><span style=\"font-family:宋体;font-size:10.5pt;\"></span>\r\n</p>\r\n<p style=\"text-align:justify;\" class=\"MsoNormal\" align=\"justify\">\r\n	<span style=\"font-family:宋体;font-size:10.5pt;\">&nbsp;</span>\r\n</p>\r\n<p class=\"16\">\r\n	<span style=\"font-family:宋体;font-size:12pt;font-weight:bold;\"><span>十、</span></span><b><span style=\"font-family:宋体;font-size:12pt;font-weight:bold;\"><span>对您信息的存储和限制</span></span></b><b><span style=\"font-family:宋体;font-size:12pt;font-weight:bold;\"></span></b>\r\n</p>\r\n<p style=\"text-align:justify;text-indent:21pt;\" class=\"MsoNormal\" align=\"justify\">\r\n	<span style=\"font-family:宋体;font-size:10.5pt;\"><span>1.</span></span><span style=\"font-family:宋体;font-size:10.5pt;\">“逸陪康”不对您所发布信息的删除或存储失败负责。“逸陪康”积极采用数据备份加密等措施保障您数据的安全，但不对由于因意外因素导致的数据损失和泄漏负责。“逸陪康”有权审查和监督您的行为是否符合本协议免责条款的要求，如果您违反了本协议免责条款的规定，则“逸陪康”有权中断您的服务。</span><span style=\"font-family:宋体;font-size:10.5pt;\"></span>\r\n</p>\r\n<p style=\"text-align:justify;\" class=\"MsoNormal\" align=\"justify\">\r\n	<span style=\"font-family:宋体;font-size:10.5pt;\">&nbsp;</span>\r\n</p>\r\n<p class=\"16\">\r\n	<span style=\"font-family:宋体;font-size:12pt;font-weight:bold;\"><span>十一、</span></span><b><span style=\"font-family:宋体;font-size:12pt;font-weight:bold;\"><span>用户</span></span></b><b><span style=\"font-family:宋体;font-size:12pt;font-weight:bold;\" class=\"15\"><span>管</span></span></b><b><span style=\"font-family:宋体;font-size:12pt;font-weight:bold;\"><span>理</span></span></b><b><span style=\"font-family:宋体;font-size:12pt;font-weight:bold;\"></span></b>\r\n</p>\r\n<p style=\"text-align:justify;text-indent:21pt;\" class=\"MsoNormal\" align=\"justify\">\r\n	<span style=\"font-family:宋体;font-size:10.5pt;\"><span>1.</span></span><span style=\"font-family:宋体;font-size:10.5pt;\"><span>您在进行注册过程中，您的用户名注册与使用应符合网络道德，遵守中华人民共和国的相关法律法规。您的用户名和昵称不能含有威胁、淫秽、谩骂、非法、侵害他人正当权益等有争议性的文字。您在</span>“逸陪康”上的言论不得违法、不得违反公序良俗原则、不得使用攻击性语言恶意中伤他人，或作出虚假性陈述。您保证您在“逸陪康”上提供的信息的真实性、合法性和有效性。您单独承担在“逸陪康”上发布内容的一切相关责任。您使用或提供的服务应遵守所有适用于“逸陪康”的地方法律、国家法律和国际法律标准。</span><span style=\"font-family:宋体;font-size:10.5pt;\"></span>\r\n</p>\r\n<p style=\"text-align:justify;text-indent:21pt;\" class=\"MsoNormal\" align=\"justify\">\r\n	<span style=\"font-family:宋体;font-size:10.5pt;\"><span>2.</span></span><span style=\"font-family:宋体;font-size:10.5pt;\"><span>您应遵守从中国境内向外传输技术性资料时必须符合中国有关法律法规。</span></span><span style=\"font-family:宋体;font-size:10.5pt;\"></span>\r\n</p>\r\n<p style=\"text-align:justify;text-indent:21pt;\" class=\"MsoNormal\" align=\"justify\">\r\n	<span style=\"font-family:宋体;font-size:10.5pt;\"><span>3.</span></span><span style=\"font-family:宋体;font-size:10.5pt;\"><span>您使用本服务不作其他非法用途。</span></span><span style=\"font-family:宋体;font-size:10.5pt;\"></span>\r\n</p>\r\n<p style=\"text-align:justify;text-indent:21pt;\" class=\"MsoNormal\" align=\"justify\">\r\n	<span style=\"font-family:宋体;font-size:10.5pt;\"><span>4.</span></span><span style=\"font-family:宋体;font-size:10.5pt;\"><span>您不得干扰或扰乱本服务。不得盗用他人账号，并对由此行为造成的后果负责。</span></span><span style=\"font-family:宋体;font-size:10.5pt;\"></span>\r\n</p>\r\n<p style=\"text-indent:21pt;\" class=\"MsoNormal\">\r\n	<span style=\"font-family:宋体;font-size:10.5pt;\">5.<span>您应遵守所有使用本服务的各项协议、规定、程序和惯例。您须承诺不传输任何非法的、骚扰性的、中伤他人的、辱骂性的、恐吓性的、伤害性的、庸俗的，淫秽等信息资料。另外，您也不能传输任何教唆他人构成犯罪行为的资料；不能传输助长国内不利条件和涉及国家安全的资料；不能传输任何不符合当地法规、国家法律和国际法律的资料。未经许可而非法进入其它电脑系统是禁止的。</span></span><span style=\"font-family:宋体;font-size:10.5pt;\"></span>\r\n</p>\r\n<p style=\"text-indent:21pt;\" class=\"MsoNormal\">\r\n	<span style=\"font-family:宋体;font-size:10.5pt;\">6.<span>您不得发布任何不基于事实、虚构、夸大、引人误解的信息；不得发布涉及政治、性别、种族歧视或攻击他人的文字、图片、视频或语言等信息；不得发布介绍个人、科室等广告性质的内容；不得有其它涉及违反当地法规、国家法律和国际法律的行为。</span></span><span style=\"font-family:宋体;font-size:10.5pt;\"></span>\r\n</p>\r\n<p style=\"text-indent:21pt;\" class=\"MsoNormal\">\r\n	<span style=\"font-family:宋体;font-size:10.5pt;\">7.<span>您发布的文章、视频、资讯不得侵犯任何第三方的合法知识产权。</span></span><span style=\"font-family:宋体;font-size:10.5pt;\"></span>\r\n</p>\r\n<p style=\"text-indent:21pt;\" class=\"MsoNormal\">\r\n	<span style=\"font-family:宋体;font-size:10.5pt;\">8.<span>若您的行为不符合本协议的规定，“逸陪康”有权做出独立判断，并立即停止向该您账号停止服务。您需对自己在网上的行为承担法律责任。您若在“逸陪康”上散布和传播反动、色情或其他违反国家法律的信息，“逸陪康”的系统记录有可能作为您违反法律的证据。</span></span><span style=\"font-family:宋体;font-size:10.5pt;\"></span>\r\n</p>\r\n<p style=\"text-indent:21pt;\" class=\"MsoNormal\">\r\n	<span style=\"font-family:宋体;font-size:10.5pt;\">9.<span>您的授权行为：对“逸陪康”而言，您账号和密码是唯一验证您真实性的依据，只有使用了正确的账号和密码无论是谁登录均视为已经得到注册您本人的授权。</span></span><span style=\"font-family:宋体;font-size:10.5pt;\"></span>\r\n</p>\r\n<p style=\"text-indent:21pt;\" class=\"MsoNormal\">\r\n	<span style=\"font-family:宋体;font-size:10.5pt;\">&nbsp;</span>\r\n</p>\r\n<p class=\"16\">\r\n	<span style=\"font-family:宋体;font-size:12pt;font-weight:bold;\"><span>十二、</span></span><b><span style=\"font-family:宋体;font-size:12pt;font-weight:bold;\"><span>保障</span></span></b><b><span style=\"font-family:宋体;font-size:12pt;font-weight:bold;\"></span></b>\r\n</p>\r\n<p style=\"text-indent:21pt;\" class=\"MsoNormal\">\r\n	<span style=\"font-family:宋体;font-size:10.5pt;\"><span>您同意保障和维护</span>“逸陪康”的利益，如果因为您违反有关法律、法规或本协议的任何规定而给“逸陪康”或任何其他第三方造成任何损失，您统一承担由此产生的损害赔偿责任，其中包括“逸陪康”为此而支付的律师费用。</span><span style=\"font-family:宋体;font-size:10.5pt;\"></span>\r\n</p>\r\n<p style=\"text-indent:21pt;\" class=\"MsoNormal\">\r\n	<span style=\"font-family:宋体;font-size:10.5pt;\">&nbsp;</span>\r\n</p>\r\n<p class=\"16\">\r\n	<span style=\"font-family:宋体;font-size:12pt;font-weight:bold;\"><span>十三、</span></span><b><span style=\"font-family:宋体;font-size:12pt;font-weight:bold;\"><span>结束服务</span></span></b><b><span style=\"font-family:宋体;font-size:12pt;font-weight:bold;\"></span></b>\r\n</p>\r\n<p style=\"text-indent:21pt;\" class=\"MsoNormal\">\r\n	<span style=\"font-family:宋体;font-size:10.5pt;\"><span>您或</span>“逸陪康”可随时根据用户管理的规范（参见本协议的第十一条）和实际情况中断一项或多项本服务，“逸陪康”无需对您或任何其他第三方负责。</span><span style=\"font-family:宋体;font-size:10.5pt;\"></span>\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span style=\"font-family:宋体;font-size:10.5pt;\">1.<span>您对本协议的修改有异议，或对“逸陪康”的服务不满，可以行使如下权利：</span></span><span style=\"font-family:宋体;font-size:10.5pt;\"></span>\r\n</p>\r\n<p style=\"text-indent:21pt;\" class=\"MsoNormal\">\r\n	<span style=\"font-family:宋体;font-size:10.5pt;\">1).<span>停止使用“逸陪康”提供的服务，</span></span><span style=\"font-family:宋体;font-size:10.5pt;\"></span>\r\n</p>\r\n<p style=\"text-indent:21pt;\" class=\"MsoNormal\">\r\n	<span style=\"font-family:宋体;font-size:10.5pt;\">2).<span>通告“逸陪康”停止对该您账号的服务，结束您的服务后，您使用本服务的权利马上终止，即刻，“逸陪康”不对您承担任何义务和责任。</span></span><span style=\"font-family:宋体;font-size:10.5pt;\"></span>\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span style=\"color:#000000;font-family:宋体;font-size:10.5pt;\">2.<span>“逸陪康”单方面解除权：</span></span><span style=\"color:#000000;font-family:宋体;font-size:10.5pt;\"></span>\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span style=\"color:#000000;font-family:宋体;font-size:10.5pt;\">1)<span>如您违反“逸陪康”的任何规定或本协议中的任何承诺或保证，包括但不限于本协议下的任何约定，“逸陪康”有权离职终止本协议，且按照有关规定对您进行处罚。</span></span><span style=\"color:#000000;font-family:宋体;font-size:10.5pt;\"></span>\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span style=\"color:#000000;font-family:宋体;font-size:10.5pt;\">2<span>）若您屡次违反本协议或相关规定，经“逸陪康”客服提醒仍不改正的，或您的言行对“逸陪康”造成人民币</span><span>1000</span><span>以上的损失，“逸陪康”有权终止与您的协议，并冻结您的账号。</span></span><span style=\"color:#000000;font-family:宋体;font-size:10.5pt;\"></span>\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span style=\"color:#000000;font-family:宋体;font-size:10.5pt;\">3<span>）</span><span>.</span><span>若双方无法达成一致，“逸陪康”无权强制医护人员使用“逸陪康”服务平台。您可根据自己的意愿，随时终止自己对“逸陪康”平台的使用。</span></span><span style=\"color:#000000;font-family:宋体;font-size:10.5pt;\"></span>\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span style=\"color:#000000;font-family:宋体;font-size:10.5pt;\">3.<span>协议终止后有关事项的处理</span><span>:</span></span><span style=\"color:#000000;font-family:宋体;font-size:10.5pt;\"></span>\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span style=\"color:#000000;font-family:宋体;font-size:10.5pt;\">1<span>）协议终止后，“逸陪康”没有义务为您保留“逸陪康”账户中与之有关的任何信息，如需再次合作，需要重新申请审核。</span></span><span style=\"color:#000000;font-family:宋体;font-size:10.5pt;\"></span>\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span style=\"color:#000000;font-family:宋体;font-size:10.5pt;\">2<span>）无论本协议因何原因终止，在协议终止前的行为所导致的任何赔偿和责任，您必须完全且独立承担。</span></span><span style=\"color:#000000;font-family:宋体;font-size:10.5pt;\"></span>\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span style=\"color:#000000;font-family:宋体;font-size:10.5pt;\">3<span>）协议终止后，“逸陪康”有权保留您的注册数据和之前服务行为记录。如您在协议终止前在服务平台上存在违反协议的行为，“逸陪康”仍可行使本协议规定的权利追究其责任。</span></span><span style=\"color:#000000;font-family:宋体;font-size:10.5pt;\"></span>\r\n</p>\r\n<p style=\"text-indent:21pt;\" class=\"MsoNormal\">\r\n	<span style=\"font-family:宋体;font-size:10.5pt;\">&nbsp;</span>\r\n</p>\r\n<p class=\"16\">\r\n	<span style=\"font-family:宋体;font-size:12pt;font-weight:bold;\"><span>十四、</span></span><b><span style=\"font-family:宋体;font-size:12pt;font-weight:bold;\"><span>通告</span></span></b><b><span style=\"font-family:宋体;font-size:12pt;font-weight:bold;\"></span></b>\r\n</p>\r\n<p style=\"text-indent:21pt;\" class=\"MsoNormal\">\r\n	<span style=\"font-family:宋体;font-size:10.5pt;\"><span>本协议项下所有的通知均可通过重要的页面公告、电子邮件或常规的信件传送等方式进行，该通知于发送之日视为已送达。</span></span><span style=\"font-family:宋体;font-size:10.5pt;\"></span>\r\n</p>\r\n<p style=\"text-indent:21pt;\" class=\"MsoNormal\">\r\n	<span style=\"font-family:宋体;font-size:10.5pt;\"><span>您对于</span>“逸陪康”的通知应当通过“逸陪康”对外正式公布的通信地址、电子邮件地址等联系信息进行邮寄书面送达。</span><span style=\"font-family:宋体;font-size:10.5pt;\"></span>\r\n</p>\r\n<p style=\"text-indent:21pt;\" class=\"MsoNormal\">\r\n	<span style=\"font-family:宋体;font-size:10.5pt;\">&nbsp;</span>\r\n</p>\r\n<p class=\"16\">\r\n	<span style=\"font-family:宋体;font-size:12pt;font-weight:bold;\"><span>十五、</span></span><b><span style=\"font-family:宋体;font-size:12pt;font-weight:bold;\"><span>广告说明</span></span></b><b><span style=\"font-family:宋体;font-size:12pt;font-weight:bold;\"></span></b>\r\n</p>\r\n<p style=\"text-indent:21pt;\" class=\"MsoNormal\">\r\n	<span style=\"font-family:宋体;font-size:10.5pt;\">1.<span>“逸陪康”上为您的便利而提供的外部链接，包括但不限于任何广告内容链接，以及该链接所指向网页的所有内容，均系该网页所属第三方“逸陪康”的所有者制作和提供（以下简称“第三方网页”）。第三方网页并非也不反映“逸陪康”的任何意见和主张，也不表示“逸陪康”同意或支持该第三方网页上的任何内容、主张或立场。“逸陪康”对第三方网页中内容的合法性、准确性、真实性、适用性、安全性和完整性等概不承担任何责任。任何单位或个人如需要第三方网页中内容（包括资讯、资料、消息、产品或服务介绍、报价等），并欲据此进行交易或其他行为前，应慎重辨别这些内容的合法性、准确性、真实性、适用性、完整性和安全性（包括下载第三方网页中内容是否会感染电脑病毒），并采取谨慎的预防措施。如您不确定这些内容是否合法、准确、真是、实用、完整和安全，建议您先咨询专业人士。</span></span><span style=\"font-family:宋体;font-size:10.5pt;\"></span>\r\n</p>\r\n<p style=\"text-indent:21pt;\" class=\"MsoNormal\">\r\n	<span style=\"font-family:宋体;font-size:10.5pt;\">2.<span>任何单位或者个人因相信、使用第三方网页中信息、服务、产品等内容，或据此进行交易等行为，而引致的人身伤亡、财产毁损（包括因下载而感染电脑病毒）、名誉或商誉诽谤、版权或知识产权等权利概不承担任何法律责任。无论何种原因，“逸陪康”不对任何非与“逸陪康”直接发生的交易和行为承担任何直接、间接、附带或衍生的损失和责任。</span></span><span style=\"font-family:宋体;font-size:10.5pt;\"></span>\r\n</p>\r\n<p style=\"text-indent:21pt;\" class=\"MsoNormal\">\r\n	<span style=\"font-family:宋体;font-size:10.5pt;\">&nbsp;</span>\r\n</p>\r\n<p class=\"16\">\r\n	<span style=\"font-family:宋体;font-size:12pt;font-weight:bold;\"><span>十六、</span></span><b><span style=\"font-family:宋体;font-size:12pt;font-weight:bold;\"><span>网络服务的内容所有权</span></span></b><b><span style=\"font-family:宋体;font-size:12pt;font-weight:bold;\"></span></b>\r\n</p>\r\n<p style=\"text-indent:21pt;\" class=\"MsoNormal\">\r\n	<span style=\"font-family:宋体;font-size:10.5pt;\">“逸陪康”提供网络服务的内容包括：文字、软件、声音、照片、视频、录像、图表；网页、广告中的全部内容；电子邮件中的全部内容；“逸陪康”为您提供的其他信息。所有这些信息均受版权、商标、标签和其他财产所有权法律的保护。未经相关权利人同意、上述资料均不得与任何媒体直接或间接发布、播放、出于播放或发布目的而改写或再发行，或者被用于其他任何商业目的。所有这些资料或资料的任何部分仅可作为私人和非商业用途而保存在某台计算机内。“逸陪康”的所有内容版权归原文作者和“逸陪康”共同所有，任何人需要转载“逸陪康”的内容，必须获得原文作者或“逸陪康”的明确授权。</span><span style=\"font-family:宋体;font-size:10.5pt;\"></span>\r\n</p>\r\n<p style=\"text-indent:21pt;\" class=\"MsoNormal\">\r\n	<span style=\"font-family:宋体;font-size:10.5pt;\">&nbsp;</span>\r\n</p>\r\n<p class=\"16\">\r\n	<span style=\"font-family:宋体;font-size:12pt;font-weight:bold;\"><span>十七、</span></span><b><span style=\"font-family:宋体;font-size:12pt;font-weight:bold;\"><span>法律</span></span></b><b><span style=\"font-family:宋体;font-size:12pt;font-weight:bold;\"></span></b>\r\n</p>\r\n<p style=\"text-indent:21pt;\" class=\"MsoNormal\">\r\n	<span style=\"font-family:宋体;font-size:10.5pt;\">1.<span>本协议效力、解释、执行和争议的解决均适用中华人民共和国的法律。如本协议的任何一部分与中华人民共和国法律相抵触，则该部分条款应按有关法律规定重新解释，部分条款之无效或重新解释不影响其它条款之法律效力。</span></span><span style=\"font-family:宋体;font-size:10.5pt;\"></span>\r\n</p>\r\n<p style=\"text-indent:21pt;\" class=\"MsoNormal\">\r\n	<span style=\"font-family:宋体;font-size:10.5pt;\">2.<span>您和“逸陪康”运营方一致同意凡因本协议所产生的纠纷双方应协商解决，协商不成任何一方可提交“逸陪康”所有人所在地法院诉讼裁决。</span></span><span style=\"font-family:宋体;font-size:10.5pt;\"></span>\r\n</p>\r\n<p style=\"text-align:justify;\" class=\"MsoNormal\" align=\"justify\">\r\n	<span style=\"font-family:宋体;font-size:12pt;\">&nbsp;</span>\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><span style=\"font-family:宋体;font-size:12pt;font-weight:bold;\">&nbsp;&nbsp;&nbsp;</span></b><b><span style=\"font-family:宋体;font-size:12pt;font-weight:bold;\"><span>十八、其他</span></span></b><b><span style=\"font-family:宋体;font-size:12pt;font-weight:bold;\"></span></b>\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span style=\"font-family:宋体;font-size:12pt;\">&nbsp;&nbsp;&nbsp;&nbsp;</span><span style=\"font-family:宋体;font-size:12pt;\"><span>医护人员注册使用本平台提供服务即视为您全接受本协议，请用户再次确认已知悉并完全理解本协议的全部内容。</span></span><span style=\"font-family:宋体;font-size:12pt;\"></span>\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span style=\"font-family:宋体;font-size:10.5pt;\">&nbsp;</span>\r\n</p>\r\n<p>\r\n	<!--EndFragment-->\r\n</p>',1488508817),(5,'groupbuy','抢购活动协议','<p>\r\n  一、抢购的所有权和运作权归本公司。\r\n</p>\r\n<p>\r\n    二、本公司有权在必要时修改本协议，本协议一旦发生变更，将会在相关页面上公布。如果您不同意所改动的内容，您应主动停止使用抢购服务。如果您继续使用服务，则视为接受本协议的变更。\r\n</p>\r\n<p>\r\n   三、如发生下列任何一种情形，本公司有权中断或终止向您提供的服务而无需通知您：\r\n</p>\r\n1、 您提供的个人资料不真实；<br />\r\n2、您违反本协议的规定；<br />\r\n3、 按照政府主管部门的监管要求；<br />\r\n4、本公司认为您的行为违反抢购服务性质或需求的特殊情形。\r\n<p>\r\n 四、尽管本协议可能另有其他规定，本公司仍然可以随时终止本协议。\r\n</p>\r\n<p>\r\n  五、本公司终止本协议的权利不会妨害本公司可能拥有的在本协议终止前因您违反本协议或本公司本应享有的任何其他权利。\r\n</p>\r\n<p>\r\n  六、您理解并完全接受，本公司有权自行对抢购资源作下线处理。\r\n</p>',1449242303),(6,'create_circle','圈子使用须知','&nbsp;&nbsp; 请您仔细阅读本须知的全部内容（特别是以<strong><span style=\"text-decoration:underline;\">粗体下划线</span></strong>标注的内容）。如果您不同意本须知的任意内容，您应当停止使用本产品。\r\n<p>\r\n	1、“圈子”是本公司开设的一个供商城用户（以下简称“用户”或“您”）交流购物体验等信息的网络社区。<strong><span style=\"text-decoration:underline;\">您使用“圈子”产品需遵守本须知，并遵守本公司公布的操作流程和规则。</span></strong> \r\n</p>\r\n<p>\r\n	2、“圈子”产品的功能和产品提供方式由本公司自行决定，后续本公司可能调整产品名称和产品运行的域名等。<strong><span style=\"text-decoration:underline;\">本须知适用于“圈子”产品的调整、改进版本和附加功能。</span></strong> \r\n</p>\r\n<p>\r\n	3、您可以通过本产品创建网络关系圈子，其他感兴趣的用户可以加入您创建的圈子。您应当遵守任何适用的法律之规定，并自觉尊重和维护其他参与者的合法权利。您不得以任何形式开展违法活动、侵犯他人合法权益、损害本公司或其他公司的合法利益，否则您需为此自行承担法律责任。<strong><span style=\"text-decoration:underline;\">您同意本公司无需为产品使用者的违法或侵权等行为承担任何责任。</span></strong> \r\n</p>\r\n<p>\r\n	4、您同意并保证通过本产品上传、发布的文字、图片等全部信息素材符合相关法律的规定。您保证素材内容以及素材所含链接指向的内容的合法性和正当性，不侵犯他人的肖像权、名誉权、知识产权、隐私权等合法权益，也不会侵犯法人或其他团体的商业秘密等合法权益。\r\n</p>\r\n<p>\r\n	5、<strong><span style=\"text-decoration:underline;\">您使用本产品可能需要提供关于您的个人资料、肖像、联系方式等个人信息。您了解并同意，在使用本产品过程中关于您的个人信息可能会通过网络等渠道进行传播。</span></strong> \r\n</p>\r\n<p>\r\n	6、您通过本产品上传、发布素材，即意味着<strong><span style=\"text-decoration:underline;\">您同意向本公司提供免费的、永久性的、不可撤销的权利和许可，使本公司可以在全球范围内复制、发行、展示、演绎和通过信息网络等渠道使用您上传的素材和信息</span></strong>，例如将您提供的图片发布于活动页面或平面媒体中。\r\n</p>\r\n<p>\r\n	7、本公司无法事先了解您上传素材的真实性和合法性。如您上传的素材被发现不适宜展示或遭受他人举报或投诉的，本公司有权立即删除或进行屏蔽从而停止该素材的继续传播。<strong><span style=\"text-decoration:underline;\">如果您违反本须知的内容、有关协议或规则等的，本公司有权删除相关素材并有权拒绝您继续使用产品，届时您无权要求本公司进行补偿或赔偿。</span></strong> \r\n</p>\r\n<p>\r\n	8、您使用本产品应同时遵守《用户服务协议》、本公司公布的各项规则以及本公司发布的关于本产品的特别规则和制度。\r\n</p>\r\n<p>\r\n	9、第三方可能通过分公司其他产品或本产品知悉并使用您上传的素材、个人信息或进而侵犯您的合法权利。<strong><span style=\"text-decoration:underline;\">本公司提醒您注意和谨防网络诈骗以及其他可能对您不利的行动和信息，但本公司对第三方的侵权、违法等行为不承担赔偿等法律责任。</span></strong>您承诺合法使用并善待其他用户上传的素材和信息。\r\n</p>\r\n<p>\r\n	10、您应自行对上传的素材进行备份。本公司可能按照本须知删除或屏蔽素材，相关系统亦可能遭受网络攻击或网络故障，类似或其他情况均可能使您上传的素材丢失或故障，对此本公司将尽力避免但不做任何保证。\r\n</p>\r\n<p>\r\n	11、<strong><span style=\"text-decoration:underline;\">如您因使用本产品与本公司发生纠纷的，您同意由本公司住所地人民法院管辖审理。</span></strong> \r\n</p>\r\n<p>\r\n	12、<strong><span style=\"text-decoration:underline;\">本公司有权更新、修改本须知以及有关规则、流程等相关文件的内容，本公司在法律允许的范围内负责对本须知进行说明和解释</span></strong>。如您对修改存有异议，您有权选择不再继续使用本产品，但您在此前的行为仍受本须知以及相关文件最新的修改版本的约束。\r\n</p>',1487809215);
