INSERT INTO `help` VALUES (96,10,'入驻流程','<div class=\"right\">\r\n	<ul class=\"right-top\">\r\n		<li class=\"single\">\r\n			<p class=\"first\">\r\n				了解入驻相关要求\r\n			</p>\r\n		</li>\r\n		<li class=\"double\">\r\n			<span>入驻标准</span> \r\n		</li>\r\n		<li class=\"single\">\r\n			<p>\r\n				入驻申请\r\n			</p>\r\n		</li>\r\n		<li class=\"double\">\r\n			<span>马上入驻</span> \r\n		</li>\r\n		<li class=\"single\">\r\n			<p>\r\n				等待审核\r\n			</p>\r\n		</li>\r\n		<li class=\"double\">\r\n			<span>查看审核进度</span> \r\n		</li>\r\n		<li class=\"single\">\r\n			<p>\r\n				入驻成功\r\n			</p>\r\n		</li>\r\n	</ul>\r\n	<div class=\"t-1\">\r\n		<p class=\"title\">\r\n			注册本站账号\r\n		</p>\r\n		<p>\r\n			点击网站右上方的“免费注册”按钮进行注册，成为本站会员\r\n		</p>\r\n	</div>\r\n	<div class=\"bg-icon\">\r\n	</div>\r\n	<div class=\"t-2\">\r\n		<p class=\"title\">\r\n			基本资料填写\r\n		</p>\r\n		<p>\r\n			进入“商家中心”，点击“立即入驻”即可进行资料填写\r\n		</p>\r\n	</div>\r\n	<div class=\"bg-icon\">\r\n	</div>\r\n	<div class=\"t-3\">\r\n		<p class=\"title\">\r\n			资质证明上传\r\n		</p>\r\n		<p>\r\n			将营业执照原件的彩色扫描件（或彩照形式）及盖公章的申请人身份证正反面复印件上传\r\n		</p>\r\n	</div>\r\n	<div class=\"bg-icon\">\r\n	</div>\r\n	<div class=\"t-4\">\r\n		<p class=\"title\">\r\n			等候审核\r\n		</p>\r\n		<p>\r\n			本站会在3个工作日内审核您的入驻申请\r\n		</p>\r\n	</div>\r\n	<div class=\"bg-icon\">\r\n	</div>\r\n	<div class=\"t-5\">\r\n		<p class=\"title\">\r\n			签署协议\r\n		</p>\r\n		<p>\r\n			审核通过后即可在线签署《神爸入驻合同》\r\n		</p>\r\n	</div>\r\n	<div class=\"bg-icon\">\r\n	</div>\r\n	<div class=\"t-6\">\r\n		<p class=\"title\">\r\n			提交保证金\r\n		</p>\r\n		<p>\r\n			商家在活动上线前须交纳 ¥10000 元商品质量和服务保证金\r\n		</p>\r\n		<p>\r\n			数码类目商家保证金为 ¥50000（等其他类目\r\n		</p>\r\n		<p>\r\n			$8500，手续费需自行承担）\r\n		</p>\r\n	</div>\r\n</div>','',1481704602,91,1),(97,2,'招商标准','<div class=\"text\">\r\n	<p>\r\n		<span>1</span>商家需具有一般纳税人或者小额纳税人资质；注册资本50万元及以上。\r\n	</p>\r\n</div>\r\n<div class=\"text\">\r\n	<p class=\"more\">\r\n		<span>2</span>我们接受各行业有一定知名度的品牌入驻，入驻企业须是品牌所有者或授权渠道商，并且确保所提供的商品\r\n          为品牌正品，价格足够有竞争力。\r\n	</p>\r\n</div>\r\n<div class=\"text\">\r\n	<span>3</span>入驻商家经营类目需是以下类目的一种或几种 <span class=\"sign\">箱包</span> <span class=\"sign\">服饰</span> <span class=\"sign\">电器</span> <span class=\"sign\">家居</span> <span class=\"sign\">办公</span> \r\n</div>\r\n<div class=\"text last-text\">\r\n	<p>\r\n		<span>4</span>入驻商家成立时间需大于1年，即商家营业执照有效期起始时间至商家提交入驻审核时间大于1年。\r\n	</p>\r\n</div>\r\n<div class=\"c-request\">\r\n	<div class=\"title\">\r\n		<span></span>公司资质要求\r\n	</div>\r\n	<table>\r\n		<tbody>\r\n			<tr>\r\n				<td class=\"col1\">\r\n					证件名称\r\n				</td>\r\n				<td>\r\n					资质要求\r\n				</td>\r\n			</tr>\r\n		</tbody>\r\n		<tbody>\r\n			<tr>\r\n				<td class=\"col1\">\r\n					1.营业执照\r\n				</td>\r\n				<td>\r\n					必须具有法人资格，如为分支机构不具有法人资格的需提供总公司营业执照及其授权书；\r\n                    完成有效年检，复印件需加盖公司公章。<a class=\"showImg\" href=\"javascript:;\">查看样例&gt;</a> \r\n				</td>\r\n			</tr>\r\n			<tr>\r\n				<td class=\"col1\">\r\n					2.税务登记证\r\n				</td>\r\n				<td>\r\n					国税、地税均可，复印件需加盖公司公章。<a class=\"showImg\" href=\"javascript:;\">查看样例&gt;</a> \r\n				</td>\r\n			</tr>\r\n			<tr>\r\n				<td class=\"col1\">\r\n					3.组织机构代码证\r\n				</td>\r\n				<td>\r\n					复印件需加盖公司公章。<a class=\"showImg\" href=\"javascript:;\">查看样例&gt;</a> \r\n				</td>\r\n			</tr>\r\n			<tr>\r\n				<td class=\"col1\">\r\n					4.法人身份证\r\n				</td>\r\n				<td>\r\n					需提供法人正反面身份证扫描件或复印件，并加盖公司公章。<a class=\"showImg\" href=\"javascript:;\">查看样例&gt;</a> \r\n				</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n</div>\r\n<div class=\"b-request\">\r\n	<div class=\"title\">\r\n		<span></span>品牌资质要求\r\n	</div>\r\n	<table>\r\n		<tbody>\r\n			<tr>\r\n				<td class=\"col1\">\r\n					证件名称\r\n				</td>\r\n				<td>\r\n					资质要求\r\n				</td>\r\n			</tr>\r\n		</tbody>\r\n		<tbody>\r\n			<tr>\r\n				<td class=\"col1\">\r\n					1.商标注册证\r\n				</td>\r\n				<td>\r\n					需提供有效期内的商标注册证，仅接受R标。\r\n				</td>\r\n			</tr>\r\n			<tr>\r\n				<td class=\"col1\">\r\n					2.品牌授权书\r\n				</td>\r\n				<td>\r\n					若品牌申请人为代理商，需提供满足以下条件的品牌授权书：\r\n					<p>\r\n						(1) 需授权在本站销售\r\n					</p>\r\n					<p>\r\n						(2) 授权书需注明授权期限、落款\r\n					</p>\r\n					<p>\r\n						(3) 若商标注册人是个人，需提供商标注册人身份证正反面复印件\r\n					</p>\r\n					<p>\r\n						(4) 需要确保授权链条的完整，即申请入驻企业拿到的授权能够逐级逆推回品牌商。\r\n					</p>\r\n				</td>\r\n			</tr>\r\n			<tr>\r\n				<td class=\"col1\">\r\n					3.质检报告或3C认证证书\r\n				</td>\r\n				<td>\r\n					每个品牌须提供一份由权威质检机构出具的最近2年内的质检报告\r\n或者有效期内的3C认证证书。<a class=\"showImg\" href=\"javascript:;\">查看详细说明&gt;</a> \r\n				</td>\r\n			</tr>\r\n			<tr>\r\n				<td class=\"col1\">\r\n					4.报关单和检验检疫证明\r\n				</td>\r\n				<td>\r\n					若为进口产品，须提交近一年内海关进口报关单和检验检疫合格证明\r\n				</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n</div>','',1455720054,1,1),(98,3,'合作细则','<div class=\"fee\">\r\n        <div class=\"title\">\r\n                <span></span>收费标准\r\n        </div>\r\n        <p>\r\n                *本站于2015年2月1日起，邀请部分品牌商家体验平台合作，暂时不收佣金。\r\n        </p>\r\n        <p>\r\n                *本站有权根据市场情况及自身经营情况调整佣金比例，但调整需至少提前30天通知商家。\r\n        </p>\r\n</div>\r\n<div class=\"fee-rule\">\r\n        <div class=\"title\">\r\n                <span></span>保证金\r\n        </div>\r\n        <p>\r\n                *商家在本站参与抢购活动必须交商品质量服务保证金（保证金主要用于保证商家按照神爸网的规则进行抢购活动，并且在商家有违规行为时\r\n根据相关规则用于向本站及消费者支付违约金）。\r\n        </p>\r\n        <p>\r\n                *商家在申请入驻获得批准时需一次性缴纳保证金，统一为人民币壹万元，食品类目商家、海外购国内商家为伍万元人民币（海外购国外商家需\r\n缴纳捌仟伍佰元美元，手续费需自行承担）\r\n        </p>\r\n        <p>\r\n                *本站有权根据商家的业务变化及实际违约赔付情况通知商家调整保证金金额，商家应在收到本站通知后的10天内补足保证金，如果没有及\r\n时补足保证金金额的，本站有权中止合作。\r\n        </p>\r\n        <p>\r\n                *由于保证金并非本站收取的费用，一直存在于您的本站企业账户中做冻结，所以不提供收据或发票，敬请谅解。\r\n        </p>\r\n        <p>\r\n                *商家如果要退出本站，终止合作，可以向本站提出保证金退还申请，本站审核通过后会在1个月内将保证金解冻至商家的本站账户内。\r\n商家同意该保证金不计算利息。\r\n        </p>\r\n        <p>\r\n                *商家有违规行为时，如根据相关规则需从已冻结保证金中支付违约金的，本站根据商家申请，按照商家实际支付金额向商家开具合法票据。\r\n开具日期为商家提交申请后的15个工作日内。\r\n        </p>\r\n        <p>\r\n                *因资质造假被清退的商家将不返还保证金，因违规行为扣取的保证金不返还，具体保证金扣取情况参见《本站合作商家违规处罚管理规定》。\r\n        </p>\r\n        <p>\r\n                *本站将根据国家经济情况、市场状况及神爸网经营情况适时适当调整保证金制度。保证金制度的调整会提前1个月公布并通知所有商家。\r\n        </p>\r\n</div>\r\n<div class=\"fee services\">\r\n        <div class=\"title\">\r\n                <span></span>48小时发货服务\r\n        </div>\r\n        <p>\r\n                *您的订单将在付款后48小时内发货。\r\n        </p>\r\n</div>\r\n<div class=\"fee baoyou\">\r\n        <div class=\"title\">\r\n                <span></span>全场包邮\r\n        </div>\r\n        <p>\r\n                *配送：本站支持偏远地区除外的下单即包邮（偏远地区包括新疆、西藏、内蒙古、宁夏、青海），特定地区按每笔最小订单加收25元运费，\r\n部分类目（一般指大件商品）因供应商原因不支持包邮送货。\r\n        </p>\r\n</div>\r\n<div class=\"fee qianshou\">\r\n        <div class=\"title\">\r\n                <span></span>验货签收\r\n        </div>\r\n        <p>\r\n                *货物当面交付的，收货人接受货物后，视为对表面一致的确认；\r\n收货人不能亲自签收，委托第三人签收时，第三人应当提供收货人的授权文件并出示收货人及第三人本人身份证原件。\r\n        </p>\r\n        <p>\r\n                对于需要先签收再打开包装查看的货物，收货人应当要求承运人当场监督并打开包装查看。如发现表面不一致，应当直接退货或者要求在签收单\r\n（收货人联和承运人联）上加注详细情况并让承运人签字确认。\r\n        </p>\r\n        <p>\r\n                收货人签字确认表面一致后，不得就表面一致的问题提出异议并要求退款。但如收货人能够提供相关证据，如物流公司证明商品签收时即存在表面\r\n一致问题的除外。\r\n        </p>\r\n        <p>\r\n                表面一致的定义：表面一致指凭肉眼或简单计量工具即可判断所收到的货物表面状况良好且与网页上的商品图片或者文字描述一致。表面一致的判\r\n断范围可参考但不限于货物的形状、大小、重量、颜色、型号、新旧程度。\r\n        </p>\r\n</div>\r\n<div class=\"fee meiliyou\">\r\n        <div class=\"title\">\r\n                <span></span>15天无理由退货服务\r\n        </div>\r\n        <h3>\r\n                一、15天无理由退货\r\n        </h3>\r\n        <p>\r\n                *本站郑重承诺：如商品未经使用或穿着，商品及外包装保持出售时的原状，商品吊牌及配件齐全，将享受15天无理由退货服务。即如果您对商\r\n品不满意，在不影响二次销售的前提下，可在收货后15天之内申请无理由退货。退回运费由您自行承担。\r\n退货金额将在供应商确认收货1个工作日内退至您的本站账户\r\n        </p>\r\n        <p>\r\n                *温馨提示：以下情况均不享受15天无理由退货服务\r\n        </p>\r\n        <p>\r\n                1、任何非本站出售的商品；\r\n        </p>\r\n        <p>\r\n                2、申请退货日期距商品签收日期超过7天的；\r\n        </p>\r\n        <p>\r\n                3、任何因非正常使用、保管或买家个人原因造成商品损坏的，包括但不限于自行修改尺寸，洗涤，皮具表面刮花、打油，刺绣，水洗、碰酸、碱、\r\n     油或者触硬物，雨天穿着，长时间穿着等；\r\n        </p>\r\n        <p>\r\n                4、未经网上申请，自行寄回至本站或供应商仓库的；\r\n        </p>\r\n        <p>\r\n                5、使用快递到付、平邮或未将商品寄至正确地址的；\r\n        </p>\r\n        <p>\r\n                6、鉴于食品安全问题，食品类商品不支持无理由退货；\r\n        </p>\r\n        <p>\r\n                7、海外购某些特殊情况不办理退货的，但仍可与商家协商；\r\n        </p>\r\n        <h3>\r\n                二、退货运费条款\r\n        </h3>\r\n        <p>\r\n                （一）15天无理由退货产生的运费由买家承担\r\n        </p>\r\n        <p>\r\n                （二）由于商品问题导致的退货，本站将提供运费补贴。同省补贴不超过10元，非同省不超过20元，特定地区不超过25元（特定地区指：新疆、\r\n          西藏、内蒙古、宁夏、青海）。\r\n        </p>\r\n        <p>\r\n                （三）、本站是限时抢购模式，商品在线时间均不超过7天，不支持换货。\r\n        </p>\r\n</div>\r\n<div class=\"fee tuihuo\">\r\n        <div class=\"title\">\r\n                <span></span>退货流程\r\n        </div>\r\n        <p>\r\n                第一步，申请退货：进入“我的神爸—我的订单”找到对应的订单，点击“售后”，填写及上传相关的信息提交退货申请。\r\n        </p>\r\n        <p>\r\n                第二步，本站审核：退货申请提交后，本站将对售后理由、图片凭证进行审核。\r\n        </p>\r\n        <p>\r\n                第三步，寄回商品：审核通过后，根据页面的退货地址退货商品，并填写有效的退货物流单号（部分退货原因无需此操作）\r\n        </p>\r\n        <p>\r\n                第四步，供应商签收：供应商签收商品后，同意退款申请。\r\n        </p>\r\n        <p>\r\n                第五步，退款完成：退款款项将在1个工作日内打款至神爸网账户。\r\n        </p>\r\n</div>\r\n<div class=\"fee peifu\">\r\n        <div class=\"title\">\r\n                <span></span>非正品赔付\r\n        </div>\r\n        <p>\r\n                本站承诺，在线销售的所有商品均为品牌正品。您在本站购买的每件商品，均由中国人民财产保险公司（PICC）承保。如您对商品是否正品\r\n存在怀疑，可到品牌专柜或有资质的机构进行鉴定，并及时通知神爸网。如鉴定结果为非正品，请提供相关证明，并在收件后90天内申请赔付。\r\n本站将按商品实付金额的三倍进行赔偿。\r\n        </p>\r\n</div>','',1455720086,1,1),(99,4,'合作品牌','<div class=\"brand_img\">\r\n	<img alt=\"image\" src=\"../files/upload/shop/article/help_store_05090420267966612.png\" /> \r\n</div>','',1455720125,1,1),(101,155,'签署入驻协议','签署入驻协议','',143549932,99,1),(102,156,'商家信息提交','商家信息提交','',143549961,99,1),(103,157,'平台审核资质','平台审核资质','',143549991,99,1),(104,158,'商家缴纳费用','商家缴纳费用','',143550031,99,1),(105,159,'店铺开通','店铺开通','',14355