DROP TABLE IF EXISTS `member`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `member` (
  `member_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '会员id',
  `member_name` varchar(50) NOT NULL COMMENT '会员名称',
  `member_truename` varchar(20) DEFAULT NULL COMMENT '真实姓名',
  `member_avatar` varchar(50) DEFAULT NULL COMMENT '会员头像',
  `member_sex` tinyint(1) DEFAULT NULL COMMENT '会员性别',
  `member_birthday` date DEFAULT NULL COMMENT '生日',
  `member_passwd` varchar(32) NOT NULL COMMENT '会员密码',
  `member_paypwd` char(32) DEFAULT NULL COMMENT '支付密码',
  `member_email` varchar(100) DEFAULT NULL COMMENT '会员邮箱',
  `member_email_bind` tinyint(4) NOT NULL DEFAULT '0' COMMENT '是否已经绑定邮箱（0未绑定1已绑定）',
  `member_mobile` varchar(11) DEFAULT NULL COMMENT '手机号',
  `member_mobile_bind` tinyint(4) NOT NULL DEFAULT '0' COMMENT '是否已经绑定手机号（0未绑定1已绑定）',
  `member_qq` varchar(100) DEFAULT NULL COMMENT 'qq',
  `member_ww` varchar(100) DEFAULT NULL COMMENT '阿里旺旺',
  `member_login_num` int(11) NOT NULL DEFAULT '1' COMMENT '登录次数',
  `member_time` varchar(10) NOT NULL COMMENT '会员注册时间',
  `member_login_time` varchar(10) NOT NULL COMMENT '当前登录时间',
  `member_old_login_time` varchar(10) NOT NULL COMMENT '上次登录时间',
  `member_login_ip` varchar(20) DEFAULT NULL COMMENT '当前登录ip',
  `member_old_login_ip` varchar(20) DEFAULT NULL COMMENT '上次登录ip',
  `member_qqopenid` varchar(100) DEFAULT NULL COMMENT 'qq互联id',
  `member_qqinfo` text COMMENT 'qq账号相关信息',
  `member_sinaopenid` varchar(100) DEFAULT NULL COMMENT '新浪微博登录id',
  `member_sinainfo` text COMMENT '新浪账号相关信息序列化值',
  `weixin_unionid` varchar(50) DEFAULT NULL COMMENT '微信用户统一标识',
  `weixin_info` varchar(255) DEFAULT NULL COMMENT '微信用户相关信息',
  `available_predeposit` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '预存款可用金额',
  `freeze_predeposit` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '预存款冻结金额',
  `available_rc_balance` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '可用充值卡余额',
  `freeze_rc_balance` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '冻结充值卡余额',
  `inform_allow` tinyint(1) NOT NULL DEFAULT '1' COMMENT '是否允许举报(1可以/2不可以)',
  `is_buy` tinyint(1) NOT NULL DEFAULT '1' COMMENT '会员是否有购买权限 1为开启 0为关闭',
  `is_allowtalk` tinyint(1) NOT NULL DEFAULT '1' COMMENT '会员是否有咨询和发送站内信的权限 1为开启 0为关闭',
  `member_state` tinyint(1) NOT NULL DEFAULT '1' COMMENT '会员的开启状态 1为开启 0为关闭',
  `member_snsvisitnum` int(11) NOT NULL DEFAULT '0' COMMENT 'sns空间访问次数',
  `member_areaid` int(11) DEFAULT NULL COMMENT '地区ID',
  `member_cityid` int(11) DEFAULT NULL COMMENT '城市ID',
  `member_provinceid` int(11) DEFAULT NULL COMMENT '省份ID',
  `member_areainfo` varchar(255) DEFAULT NULL COMMENT '地区内容',
  `member_privacy` text COMMENT '隐私设定',
  `member_exppoints` int(11) NOT NULL DEFAULT '0' COMMENT '会员经验值',
  `invite_one` int(10) DEFAULT '0' COMMENT '一级会员',
  `invite_two` int(10) DEFAULT '0' COMMENT '二级会员',
  `invite_three` int(10) DEFAULT '0' COMMENT '三级会员',
  `inviter_id` int(11) DEFAULT '1' COMMENT '邀请人ID 默认是1（平台）平台的推荐人是0，平台没有推荐人，查找member_id=0的会员就返回false',
  `member_tree_id` int(11) DEFAULT NULL COMMENT '客户树id',
  `member_tree_row` int(11) DEFAULT NULL COMMENT '在客户树的哪一行',
  `member_tree_column` int(11) DEFAULT NULL COMMENT '在客户树的哪一列',
  `member_tree_left_invite_count` int(11) DEFAULT '0' COMMENT '在客户树中在自己的左树中自己邀请的会员人数',
  `member_tree_right_invite_count` int(11) DEFAULT '0' COMMENT '在客户树中在自己的右树中自己邀请的会员人数',
  `store_tree_id` int(11) DEFAULT NULL COMMENT '医护人员树id',
  `store_tree_row` int(11) DEFAULT NULL COMMENT '在医护人员树的哪一行',
  `store_tree_column` int(11) DEFAULT NULL COMMENT '在医护人员的哪一列',
  `store_tree_left_invite_count` int(11) DEFAULT '0' COMMENT '在医护人员树中在自己的左树中自己邀请的会员人数',
  `store_tree_right_invite_count` int(11) DEFAULT '0' COMMENT '在医护人员树中在自己的右树中自己邀请的会员人数',
  `member_points` int(11) DEFAULT '0' COMMENT '当前会员在客户树中买东西所积累获得的总积分',
  `member_self_used_points_sum` int(11) DEFAULT '0' COMMENT '当前会员在客户树中参与积分碰撞自己已经积累消耗掉的自己的总积分',
  `member_left_used_points_sum` int(11) DEFAULT '0' COMMENT '当前会员在客户树中参与积分碰撞已经积累消耗掉的左子树的总积分',
  `member_right_used_points_sum` int(11) DEFAULT '0' COMMENT '当前会员在客户树中参与积分碰撞已经积累消耗掉的右子树的总积分',
  `member_collision_sum_times` int(11) DEFAULT '0' COMMENT '客户树当月积分碰撞积累次数',
  `member_collision_sum_money` decimal(10,2) DEFAULT '0.00' COMMENT '客户树积分碰撞积累剩余奖金',
  `store_points` int(11) DEFAULT '0' COMMENT '当前会员在医护人员树中卖出服务所积累获得的总积分',
  `store_self_used_points_sum` int(11) DEFAULT '0' COMMENT '当前会员在医护人员树中参与积分碰撞自己已经积累消耗掉的自己的总积分',
  `store_left_used_points_sum` int(11) DEFAULT '0' COMMENT '当前会员在医护人员树中参与积分碰撞已经积累消耗掉的左子树的总积分',
  `store_right_used_points_sum` int(11) DEFAULT '0' COMMENT '当前会员在医护人员树中参与积分碰撞已经积累消耗掉的右子树的总积分',
  `store_collision_sum_times` int(11) DEFAULT '0' COMMENT '医护人员树当月积分碰撞积累次数',
  `store_collision_sum_money` decimal(10,2) DEFAULT '0.00' COMMENT '医护人员树积分碰撞积累剩余奖金',
  `member_type_id` int(11) DEFAULT '1' COMMENT '会员类型id 默认是1（客户）',
  `member_tree_level` int(11) DEFAULT '1' COMMENT '会员在树中的级别 1 铜卡 2 银卡 3金卡 医务人员全部是金卡级',
  `member_tree_final_level` int(11) DEFAULT NULL COMMENT '客户树终身等级',
  `store_tree_final_level` int(11) DEFAULT NULL COMMENT '医护人员树终身等级',
  `upgrade_time` int(11) DEFAULT NULL COMMENT '会员金银铜卡升级时间',
  `member_commission_money_sum` decimal(10,2) DEFAULT '0.00' COMMENT '客户树分佣积累奖金',
  `store_commission_money_sum` decimal(10,2) DEFAULT '0.00' COMMENT '医护人员树分佣积累奖金',
  `member_straight_money_sum` decimal(10,2) DEFAULT '0.00' COMMENT '客户树中直荐奖奖金总和',
  `store_straight_money_sum` decimal(10,2) DEFAULT '0.00' COMMENT '医务人员树中直荐奖奖金总和',
  `store_share_benefits_money_sum` decimal(10,2) DEFAULT '0.00' COMMENT '医务人员分利奖金总和',
  PRIMARY KEY (`member_id`),
  KEY `member_name` (`member_name`)
) ENGINE=InnoDB AUTO_INCREMENT=196 DEFAULT CHARSET=utf8 COMMENT='会员表';
/*!40101 SET character_set_client = @saved_cs_client */;

