DROP TABLE IF EXISTS `member_straight_log`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `member_straight_log` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `member_id` int(11) DEFAULT NULL COMMENT '得到直荐奖的人的member_id',
  `buyer_id` int(11) DEFAULT NULL COMMENT '购买者member_id',
  `buyer_name` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '购买者名字',
  `buy_money` decimal(10,2) DEFAULT '0.00' COMMENT '买了多少钱的东西',
  `member_straight_money` decimal(10,2) DEFAULT '0.00' COMMENT '客户树获得的直荐奖',
  `seller_id` int(11) DEFAULT NULL COMMENT '卖出去服务的医务人员的member_id',
  `seller_name` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '卖出服务的医务人员名字',
  `sale_money` decimal(10,2) DEFAULT '0.00' COMMENT '卖出服务分利所得的钱',
  `store_straight_money` decimal(10,2) DEFAULT '0.00' COMMENT '医务人员树获得的直荐奖',
  `member_tree_type` int(11) DEFAULT '0' COMMENT '是从哪个树获取的直荐奖 0客户树 1医务人员树',
  `add_time` int(11) DEFAULT NULL COMMENT '直荐奖获取时间',
  `order_id` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `member_straight_log_id_uindex` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=156 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='会员直荐奖日志表';
/*!40101 SET character_set_client = @saved_cs_client */;

